INSERT INTO `wp_options` (`option_id`, `option_name`, `option_value`, `autoload`) VALUES
	(472, 'pmpro_addons', 'a:106:{i:0;a:16:{s:4:"Name";s:44:"Paid Memberships Pro - Add Member From Admin";s:5:"Title";s:44:"Paid Memberships Pro - Add Member From Admin";s:9:"PluginURI";s:67:"https://www.paidmembershipspro.com/add-ons/add-member-admin-add-on/";s:4:"Slug";s:22:"pmpro-add-member-admin";s:6:"plugin";s:49:"pmpro-add-member-admin/pmpro-add-member-admin.php";s:7:"Version";s:5:"0.7.2";s:11:"Description";s:48:"Allow admins to add members in the WP dashboard.";s:12:"Installation";s:502:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-add-member-admin</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to Memberships -&gt; Add Member to add a new member.</li>\n<li>When viewing the member\'s list or user\'s list in the dashboard a "+ order" link will show up under the username that can be used to add a new order for an existing user through the same form.</li>\n</ol>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:523:"<h4>Changelog</h4><p>0.7.2 - 2024-01-25</p><ul>\n<li>SECURITY: Improved sanitization and escaping throughout the plugin. #56 (@JarrydLong)</li>\n<li>ENHANCEMENT: Added a link to the Edit Member page if using PMPro v3.0+. #60 (@dparker1005)</li>\n<li>BUG FIX/ENHANCEMENT: Added some missing email template variables to the "add member added admin" email. #55 (@andrewlimaza)</li>\n<li>BUG FIX/ENHANCEMENT: Marking plugin as incompatible with Multiple Memberships Per User for the PMPro v3.0 update. #59 (@dparker1005)</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:83:"http://license.paidmembershipspro.com/downloads/standard/pmpro-add-member-admin.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:21:"Add Member From Admin";}i:1;a:16:{s:4:"Name";s:43:"Paid Memberships Pro - Add Name to Checkout";s:5:"Title";s:43:"Paid Memberships Pro - Add Name to Checkout";s:9:"PluginURI";s:75:"https://www.paidmembershipspro.com/add-ons/add-first-last-name-to-checkout/";s:4:"Slug";s:26:"pmpro-add-name-to-checkout";s:6:"plugin";s:57:"pmpro-add-name-to-checkout/pmpro-add-name-to-checkout.php";s:7:"Version";s:3:"0.7";s:11:"Description";s:97:"Adds first and last name fields to the user account section at checkout for Paid Memberships Pro.";s:12:"Installation";s:272:"<p>Installation</p><p>Download, Install and Activate!</p><ol>\n<li>Upload the <code>pmpro-add-name-to-checkout</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:575:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-add-name-to-checkout/issues">https://github.com/strangerstudios/pmpro-add-name-to-checkout/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:132:"<h4>Changelog</h4><p>0.7 - 2024-07-18</p><ul>\n<li>ENHANCEMENT: Updated the frontend UI for compatibility with PMPro v3.1.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:35:"https://www.paidmembershipspro.com/";s:8:"Download";s:87:"http://license.paidmembershipspro.com/downloads/standard/pmpro-add-name-to-checkout.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:20:"Add Name to Checkout";}i:2;a:16:{s:4:"Name";s:48:"Paid Memberships Pro - Add PayPal Express Add On";s:5:"Title";s:48:"Paid Memberships Pro - Add PayPal Express Add On";s:9:"PluginURI";s:84:"https://www.paidmembershipspro.com/add-ons/pmpro-add-paypal-express-option-checkout/";s:4:"Slug";s:24:"pmpro-add-paypal-express";s:6:"plugin";s:53:"pmpro-add-paypal-express/pmpro-add-paypal-express.php";s:7:"Version";s:3:"0.7";s:11:"Description";s:49:"Add PayPal Express as a Second Option at Checkout";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:85:"http://license.paidmembershipspro.com/downloads/standard/pmpro-add-paypal-express.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:18:"Add PayPal Express";}i:3;a:16:{s:4:"Name";s:37:"Paid Memberships Pro - Addon Packages";s:5:"Title";s:37:"Paid Memberships Pro - Addon Packages";s:9:"PluginURI";s:82:"https://www.paidmembershipspro.com/add-ons/pmpro-purchase-access-to-a-single-page/";s:4:"Slug";s:20:"pmpro-addon-packages";s:6:"plugin";s:45:"pmpro-addon-packages/pmpro-addon-packages.php";s:7:"Version";s:3:"0.9";s:11:"Description";s:95:"Sell members-only access to individual pages or posts, or sell a la carte items for a flat fee.";s:12:"Installation";s:280:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-addon-packages</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Edit a post or page to set a price for it.</li>\n</ol>";s:3:"FAQ";s:810:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-addon-packages/issues">https://github.com/strangerstudios/pmpro-addon-packages/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\n<p>Please Note: This plugin is meant as a temporary solution. Most updates and fixes will be reserved for when this functionality is built into Paid Memberships Pro. We may not fix the pmpro-addon-packages plugin itself unless it is critical.</p>";s:9:"Changelog";s:164:"<h4>Changelog</h4><p>0.9 - 2024-07-18</p><ul>\n<li>ENHANCEMENT: Updated the frontend UI for compatibility with PMPro v3.1. #65 (@dparker1005, @kimcoleman)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:77:"http://license.paidmembershipspro.com/downloads/plus/pmpro-addon-packages.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:14:"Addon Packages";}i:4;a:16:{s:4:"Name";s:53:"Paid Memberships Pro - Address For Free Levels Add On";s:5:"Title";s:53:"Paid Memberships Pro - Address For Free Levels Add On";s:9:"PluginURI";s:92:"https://www.paidmembershipspro.com/add-ons/capture-name-address-free-levels-offsite-gateway/";s:4:"Slug";s:29:"pmpro-address-for-free-levels";s:6:"plugin";s:63:"pmpro-address-for-free-levels/pmpro-address-for-free-levels.php";s:7:"Version";s:3:"0.5";s:11:"Description";s:66:"Show address fields for free levels also with Paid Memberships Pro";s:12:"Installation";s:237:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-address-for-free-levels</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:830:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-address-for-free-levels/issues">https://github.com/strangerstudios/pmpro-address-for-free-levels/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>\n<p>Please Note: This plugin is meant as a temporary solution. Most updates and fixes will be reserved for when this functionality is built into Paid Memberships Pro. We may not fix the pmpro-addon-packages plugin itself unless it is critical.</p>";s:9:"Changelog";s:363:"<h4>Changelog</h4><p>0.5 - 2021-08-03</p><ul>\n<li>ENHANCEMENT: Strings wrapped for localization.</li>\n<li>BUG FIX/ENHANCEMENT: Fixed issue where the "Billing" label in the heading wasn\'t being hidden properly for free levels.</li>\n<li>BUG FIX: Fixed issues with session handling when using PayPal Express/etc. Fields were not being saved on some sites.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:35:"https://www.paidmembershipspro.com/";s:8:"Download";s:86:"http://license.paidmembershipspro.com/downloads/plus/pmpro-address-for-free-levels.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:23:"Address For Free Levels";}i:5;a:16:{s:4:"Name";s:50:"Paid Memberships Pro - Advanced Levels Page Add On";s:5:"Title";s:50:"Paid Memberships Pro - Advanced Levels Page Add On";s:9:"PluginURI";s:75:"https://www.paidmembershipspro.com/add-ons/pmpro-advanced-levels-shortcode/";s:4:"Slug";s:31:"pmpro-advanced-levels-shortcode";s:6:"plugin";s:67:"pmpro-advanced-levels-shortcode/pmpro-advanced-levels-shortcode.php";s:7:"Version";s:3:"1.2";s:11:"Description";s:106:"Build a beautiful membership levels page for Paid Memberships Pro using a customizable block or shortcode.";s:12:"Installation";s:615:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-advanced-levels</code> folder to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Replace the [pmpro_levels] shortcode on your site with the Advanced Levels Page block or [pmpro_advanced_levels] shortcode.</li>\n</ol>\n<p>For more information about block settings and shortcode attributes, see the documentation here:\n<a href="https://www.paidmembershipspro.com/add-ons/pmpro-advanced-levels-shortcode/">https://www.paidmembershipspro.com/add-ons/pmpro-advanced-levels-shortcode/</a></p>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:150:"<h4>Changelog</h4><p>1.2 - 2024-07-18</p><ul>\n<li>ENHANCEMENT: Updated the frontend UI for compatibility with PMPro v3.1. #73 (@kimcoleman)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:35:"https://www.paidmembershipspro.com/";s:8:"Download";s:92:"http://license.paidmembershipspro.com/downloads/standard/pmpro-advanced-levels-shortcode.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:20:"Advanced Levels Page";}i:6;a:16:{s:4:"Name";s:40:"Paid Memberships Pro - Affiliates Add On";s:5:"Title";s:40:"Paid Memberships Pro - Affiliates Add On";s:9:"PluginURI";s:80:"https://www.paidmembershipspro.com/add-ons/pmpro-lightweight-affiliate-tracking/";s:4:"Slug";s:16:"pmpro-affiliates";s:6:"plugin";s:37:"pmpro-affiliates/pmpro-affiliates.php";s:7:"Version";s:5:"0.6.1";s:11:"Description";s:82:"Create affiliate accounts with unique referrer URLs to track membership checkouts.";s:12:"Installation";s:741:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-affiliates</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Manage affiliates through the "affiliates" admin page added under Memberships.</li>\n<li>Affiliate URLs will look like <a href="http://site.com/?pa=AFFILIATECODE">http://site.com/?pa=AFFILIATECODE</a></li>\n<li>You can add a "subid" to the URL on the fly for more granular tracking <a href="http://site.com/?pa=AFFILIATECODE&amp;subid=TEST1">http://site.com/?pa=AFFILIATECODE&amp;subid=TEST1</a></li>\n<li>Create a page with the [pmpro_affiliates_report] shortcode and direct your affiliate users to that page.</li>\n</ol>";s:3:"FAQ";s:555:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-affiliates/issues">https://github.com/strangerstudios/pmpro-affiliates/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:631:"<h4>Changelog</h4><p>0.6.1 - 2024-01-05</p><ul>\n<li>ENHANCEMENT: Updating <code>&lt;h3&gt;</code> tags to <code>&lt;h2&gt;</code> tags for better accessibility. #51 (@kimwhite)</li>\n<li>BUG FIX: Fixed a warning on the reports page when the affiliate name was missing from the report. #52 (@andrewlimaza)</li>\n<li>BUG FIX: Fixed an issue with exporting the affiliates CSV wouldn\'t include the affiliates name. #52 (@andrewlimaza)</li>\n<li>REFACTOR: Now using the <code>pmpro_default_discount_code</code> filter for sites using PMPro v3.0+ instead of setting discount code by altering request variables. #50 (@dparker1005)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:77:"http://license.paidmembershipspro.com/downloads/standard/pmpro-affiliates.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:10:"Affiliates";}i:7;a:16:{s:4:"Name";s:42:"Paid Memberships Pro - Akismet Integration";s:5:"Title";s:42:"Paid Memberships Pro - Akismet Integration";s:9:"PluginURI";s:57:"https://www.paidmembershipspro.com/add-ons/pmpro-akismet/";s:4:"Slug";s:13:"pmpro-akismet";s:6:"plugin";s:31:"pmpro-akismet/pmpro-akismet.php";s:7:"Version";s:3:"1.1";s:11:"Description";s:86:"Protect your membership site from checkout spam with Akismet and Paid Memberships Pro.";s:12:"Installation";s:1545:"<p>Installation</p><p>Note: You must have <a href="https://wordpress.org/plugins/paid-memberships-pro/">Paid Memberships Pro</a> and <a href="https://wordpress.org/plugins/akismet/">Akismet</a> installed and activated on your site.</p>\n<h3>Install PMPro Akismet from within WordPress</h3>\n<ol>\n<li>Make sure Paid Memberships Pro is active.</li>\n<li>Visit Memberships &gt; Add Ons</li>\n<li>Locate this plugin and click "Install"</li>\n<li>Activate "Paid Memberships Pro - Akismet Integration" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>Install PMPro Akismet Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-akismet</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate "Paid Memberships Pro - Akismet Integration" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>After Activation: How to Use</h3>\n<p>This plugin relies on the settings you have configured within the main Akismet plugin.</p>\n<p>Navigate to Settings &gt; Akismet Anti-Spam to configure your general Akismet settings.</p>\n<p>PMPro Akismet will automatically detect spam at checkout and prevent submissions if they are considered spam. If you have enabled the setting to "Display a privacy notice under your comment forms," this message will also display on your membership checkout page.</p>\n<p>View full documentation at: <a href="https://www.paidmembershipspro.com/add-ons/pmpro-akismet/">https://www.paidmembershipspro.com/add-ons/pmpro-akismet/</a>.</p>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:732:"<h4>Changelog</h4><p>1.1 - 2024-08-12</p><ul>\n<li>FEATURE: Now only blocking "definite" spam. For "likely spam", users are prompted to checkout again.</li>\n<li>ENHANCEMENT: Now always tracking likely spam responses from Akismet as "spam activity" for the PMPro spam blocker. Folks testing cards on checkout pages are blocked twice as fast now.</li>\n<li>ENHANCEMENT: You can use the <code>pmpro_akismet_threshold</code> filter and have it return 1 instead of 2 to use the stricter rules where all likely spam is treated as spam and blocked.</li>\n<li>ENHANCEMENT/BUG FIX: Fixed formatting of the Akismet link if shown via the <code>pmpro_akismet_checkout_privacy_notice</code> filter. Have that return \'display\' to display.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:70:"http://license.paidmembershipspro.com/downloads/free/pmpro-akismet.zip";s:7:"License";s:4:"free";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:19:"Akismet Integration";}i:8;a:16:{s:4:"Name";s:39:"Paid Memberships Pro - Approvals Add On";s:5:"Title";s:39:"Paid Memberships Pro - Approvals Add On";s:9:"PluginURI";s:71:"https://www.paidmembershipspro.com/add-ons/approval-process-membership/";s:4:"Slug";s:15:"pmpro-approvals";s:6:"plugin";s:35:"pmpro-approvals/pmpro-approvals.php";s:7:"Version";s:3:"1.6";s:11:"Description";s:75:"Grants administrators the ability to approve/deny memberships after signup.";s:12:"Installation";s:1053:"<p>Installation</p><p>Prerequisites</p><ol>\n<li>You must have Paid Memberships Pro installed and activated on your site.</li>\n</ol><p>Download, Install and Activate!</p><ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-approvals/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>How to Use</p><ol>\n<li>To set a level\'s approval requirements, edit your membership level and adjust the settings under "Approval Settings".</li>\n<li>To process membership approvals, navigate to the Approvals Dashboard under Memberships &gt; Approvals.</li>\n<li>To customize the emails related to this plugin, navigate to Memberships &gt; Settings &gt; Email Templates in the WordPress admin.</li>\n</ol>\n<p>View full documentation at: <a href="https://www.paidmembershipspro.com/add-ons/approval-process-membership/">https://www.paidmembershipspro.com/add-ons/approval-process-membership/</a></p>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:365:"<h4>Changelog</h4><p>1.6 - 2024-07-18</p><ul>\n<li>ENHANCEMENT: Updated the frontend UI for compatibility with PMPro v3.1. #186 (@dparker1005)</li>\n<li>ENHANCEMENT: Added a new filter <code>pmpro_approvals_show_level_confirmation_message</code> to allow showing the level confirmation message within the approval confirmation message. #183 (@andrewlimaza)</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:72:"http://license.paidmembershipspro.com/downloads/plus/pmpro-approvals.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:9:"Approvals";}i:9;a:16:{s:4:"Name";s:44:"Paid Memberships Pro - Auto-Renewal Checkbox";s:5:"Title";s:44:"Paid Memberships Pro - Auto-Renewal Checkbox";s:9:"PluginURI";s:85:"https://www.paidmembershipspro.com/add-ons/auto-renewal-checkbox-membership-checkout/";s:4:"Slug";s:27:"pmpro-auto-renewal-checkbox";s:6:"plugin";s:59:"pmpro-auto-renewal-checkbox/pmpro-auto-renewal-checkbox.php";s:7:"Version";s:5:"0.3.2";s:11:"Description";s:55:"Make auto-renewal optional at checkout with a checkbox.";s:12:"Installation";s:307:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-auto-renewal-checkbox</code> folder to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Edit your membership levels and set the "Auto Renewal" options for each level.</li>\n</ol>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:176:"<h4>Changelog</h4><p>0.3.2 - 2024-02-23</p><ul>\n<li>ENHANCEMENT: Added compatibility with Multiple Memberships Per User for the PMPro v3.0 update. #33 (@dparker1005)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:88:"http://license.paidmembershipspro.com/downloads/standard/pmpro-auto-renewal-checkbox.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:21:"Auto-Renewal Checkbox";}i:10;a:16:{s:4:"Name";s:36:"Paid Memberships Pro - AvaTax Add On";s:5:"Title";s:36:"Paid Memberships Pro - AvaTax Add On";s:9:"PluginURI";s:69:"https://www.paidmembershipspro.com/add-ons/avalara-avatax-integration";s:4:"Slug";s:12:"pmpro-avatax";s:6:"plugin";s:29:"pmpro-avatax/pmpro-avatax.php";s:7:"Version";s:3:"0.1";s:11:"Description";s:74:"Integrate with Avalara AvaTax for automated sales and use tax calculation.";s:12:"Installation";s:889:"<p>Installation</p><p>Prerequisites</p><ol>\n<li>You must have Paid Memberships Pro installed and activated on your site.</li>\n<li>You must have a <a href="https://www.avalara.com">subscription with Avalara</a> to use this service.</li>\n</ol><p>Download, Install and Activate!</p><ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-avatax/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>Settings</p><ol>\n<li>Navigate to Memberships &gt; AvaTax in the WordPress admin.</li>\n<li>Complete the fields in the "Credentials" section to connect your membership site to your Avalara account.</li>\n<li>Complete the fields with your "Company" information and configure additional options.</li>\n<li>Save settings.</li>\n</ol>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:61:"<h4>Changelog</h4><p>0.1</p><ul>\n<li>First commit.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:69:"http://license.paidmembershipspro.com/downloads/free/pmpro-avatax.zip";s:7:"License";s:4:"free";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:6:"AvaTax";}i:11;a:16:{s:4:"Name";s:36:"Paid Memberships Pro - AWeber Add On";s:5:"Title";s:36:"Paid Memberships Pro - AWeber Add On";s:9:"PluginURI";s:68:"https://www.paidmembershipspro.com/add-ons/pmpro-aweber-integration/";s:4:"Slug";s:12:"pmpro-aweber";s:6:"plugin";s:29:"pmpro-aweber/pmpro-aweber.php";s:7:"Version";s:5:"1.3.4";s:11:"Description";s:70:"Add users and members to AWeber lists based on their membership level.";s:12:"Installation";s:1319:"<p>Installation</p><p>This plugin works with and without Paid Memberships Pro installed.</p><p>Download, Install and Activate!</p><ol>\n<li>Upload the <code>pmpro-aweber</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to Settings &gt; PMPro Aweber to proceed with setup.</li>\n</ol><p>Configuration and Settings</p><p><strong>Authorize your app with AWeber:</strong> Your Authorization Code will be provided once the app is authorized with your AWeber account. Navigate to Settings &gt; PMPro AWeber in the WordPress dashboard to authorize your app with AWeber.</p>\n<p>After entering your Authorization Code, continue with the setup by assigning All User Lists, Membership Level Lists, and review the additional settings.</p>\n<p>For full documentation on all settings, please visit the <a href="https://www.paidmembershipspro.com/add-ons/pmpro-aweber-integration/">AWeber Integration Add On documentation page at Paid Memberships Pro</a>. </p>\n<p>Filter hooks are available for developers that need to customize specific aspects of the integration. <a href="https://www.paidmembershipspro.com/add-ons/pmpro-aweber-integration/#hooks">Please explore the plugin\'s action and filter hooks here</a>.</p>";s:3:"FAQ";s:547:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-aweber/issues">https://github.com/strangerstudios/pmpro-aweber/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:168:"<h4>Changelog</h4><p>1.3.4 - 2023-12-05</p><ul>\n<li>ENHANCEMENT: Added support for Multiple Memberships Per User and Paid Memberships Pro 3.0 (@dparker1005).</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:35:"https://www.paidmembershipspro.com/";s:8:"Download";s:55:"https://downloads.wordpress.org/plugin/pmpro-aweber.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:6:"AWeber";}i:12;a:16:{s:4:"Name";s:18:"Basic User Avatars";s:5:"Title";s:18:"Basic User Avatars";s:9:"PluginURI";s:49:"https://wordpress.org/plugins/basic-user-avatars/";s:4:"Slug";s:18:"basic-user-avatars";s:6:"plugin";s:41:"basic-user-avatars/basic-user-avatars.php";s:7:"Version";s:5:"1.0.8";s:11:"Description";s:111:"Add an avatar upload field on frontend pages and Edit Profile screen so users can add a custom profile picture.";s:12:"Installation";s:1109:"<p>Installation</p><ol>\n<li>Upload <code>basic-user-avatars</code> to your <code>/wp-content/plugins/</code> directory or download through the Plugins page.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>If you only want users with file upload capabilities to upload avatars, check the applicable option under Settings &gt; Discussion.</li>\n<li>Navigate to Users &gt; Edit User to upload a custom avatar for your users.</li>\n<li>Add the <code>[basic-user-avatars]</code> shortcode to a page in your WordPress site to allow front-end avatar upload for your users.</li>\n</ol>\n<p>bbPress support is added automatically if bbPress is activated.</p>\n<p><strong><a href="https://github.com/strangerstudios/basic-user-avatars/">This plugin is on GitHub</a></strong> and pull requests are welcome. If possible please report issues through Github.</p>\n<p>Note: This plugin is a fork of Simple Local Avatars v1.3.1 by Jake Goldman and 10up. Check out <a href="http://wordpress.org/plugins/simple-local-avatars">Simple Local Avatars</a> to compare their latest release to this plugin.</p>";s:3:"FAQ";s:578:"<p>Frequently Asked Questions</p><p>I\'m still having problems</p><p>While this plugin has been tested with common server setups, some enviroments could cause an issue.</p>\n<p>If you are having a problem deactivate all plugins other than this one and then switch your theme to TwentyTweleve (or similar). If things work, then the issue is with a 3rd party theme or plugin.</p>\n<p>If things are still not functioning properly then proceed to reporting an issue. The ideal method is via <a href="https://github.com/strangerstudios/basic-user-avatars/issues/">GitHub issues</a>.</p>";s:9:"Changelog";s:506:"<h4>Changelog</h4><p>1.0.8 - 2024-01-23</p><ul>\n<li>ENHANCEMENT: Added filter \'basic_user_avatars_default_size\' to allow changing the default size of the avatar. (Thanks @jarrydlong)</li>\n<li>ENHANCEMENT: Improved functionality on how we load the text domain of the plugin for translations. (@ipokkel)</li>\n<li>BUG FIX: Fixed a fatal issue when the option "Only allow users with file upload capabilities to upload local avatars (Authors and above)" wasn\'t set on new installations. (@JarrydLong)</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:32:"https://www.strangerstudios.com/";s:8:"Download";s:61:"https://downloads.wordpress.org/plugin/basic-user-avatars.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:18:"Basic User Avatars";}i:13;a:16:{s:4:"Name";s:37:"Paid Memberships Pro - bbPress Add On";s:5:"Title";s:37:"Paid Memberships Pro - bbPress Add On";s:9:"PluginURI";s:57:"https://www.paidmembershipspro.com/add-ons/pmpro-bbpress/";s:4:"Slug";s:13:"pmpro-bbpress";s:6:"plugin";s:31:"pmpro-bbpress/pmpro-bbpress.php";s:7:"Version";s:5:"1.7.3";s:11:"Description";s:104:"Restrict access to bbPress for free or premium members by integrating bbPress with Paid Memberships Pro.";s:12:"Installation";s:2408:"<p>Installation</p><p>Note: You must have <a href="https://wordpress.org/plugins/paid-memberships-pro/">Paid Memberships Pro</a> and <a href="https://wordpress.org/plugins/bbpress/">bbPress</a> installed and activated on your site.</p>\n<h3>Install PMPro bbPress from within WordPress</h3>\n<ol>\n<li>Visit the plugins page within your dashboard and select "Add New"</li>\n<li>Search for "PMPro bbPress"</li>\n<li>Locate this plugin and click "Install"</li>\n<li>Activate "Paid Memberships Pro - bbPress Integration" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>Install PMPro bbPress Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-bbpress</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate "Paid Memberships Pro - bbPress Integration" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>After Activation: Create a Private Forum</h3>\n<ol>\n<li>Navigate to Forums &gt; Edit Forum to restrict access to the forum and make it private.</li>\n<li>Or, create a new Forum under Forums &gt; Add New.</li>\n<li>In the right column "Settings" panel, locate the "Require Membership" section.</li>\n<li>Check the box for one or more membership level that can access this forum.</li>\n<li>Save your changes by clicking the "Update" button (or "Publish" if you are creating a new forum).</li>\n<li>Further settings can be found on the Settings &gt; Forums page of your admin dashboard.</li>\n</ol>\n<h3>Shortcode for Member Activity</h3>\n<p>The bbPress Integration for Paid Memberships Pro includes one shortcode to display a member\'s activity (topics or replies created).</p><p>Sample shortcode usage:</p><p><code>[bbp-user-activity activity_type="topic" show_date="true" title="My Recent Topics"]</code></p><p>Shortcode attributes include:</p><ul>\n<li>activity_type: Accepts \'topic\' or \'reply\'. Default is \'topic\'</li>\n<li>bbp_user_id: Accepts any user ID. Omit this attribute to load the current user\'s entries. Default is the <code>current_user-&gt;ID</code>.</li>\n<li>count: The number of entries to show. Default is \'5\'.</li>\n<li>show_date: Optionally show the entry date. Default is \'false\'.</li>\n<li>show_excerpt: Optionally show a 50-character excerpt of the entry. Default is \'false\'.</li>\n<li>title: An optional title for the shortcode output, wrapped in the h2 class="widgettitle" format.</li>\n</ul>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:286:"<h4>Changelog</h4><p>1.7.3 - 2021-08-13</p><ul>\n<li>BUG FIX: Fixed issue that was causing fatal errors when WP_Query didn\'t contain posts when other plugins were setting the query. Fixes an issue for Formidable Pro/Registrations and improves compatibility with other plugins.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:56:"https://downloads.wordpress.org/plugin/pmpro-bbpress.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:7:"bbPress";}i:14;a:16:{s:4:"Name";s:50:"Paid Memberships Pro - Better Logins Report Add On";s:5:"Title";s:50:"Paid Memberships Pro - Better Logins Report Add On";s:9:"PluginURI";s:64:"http://www.paidmembershipspro.com/wp/pmpro-better-logins-report/";s:4:"Slug";s:26:"pmpro-better-logins-report";s:6:"plugin";s:57:"pmpro-better-logins-report/pmpro-better-logins-report.php";s:7:"Version";s:6:".2.3.2";s:11:"Description";s:66:"Adds login, view, and visit stats for "This Week" and "This Year".";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:30:"http://www.strangerstudios.com";s:8:"Download";s:84:"https://license.paidmembershipspro.com/downloads/plus/pmpro-better-logins-report.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:20:"Better Logins Report";}i:15;a:16:{s:4:"Name";s:52:"Paid Memberships Pro - BuddyPress & BuddyBoss Add On";s:5:"Title";s:52:"Paid Memberships Pro - BuddyPress & BuddyBoss Add On";s:9:"PluginURI";s:65:"https://www.paidmembershipspro.com/add-ons/buddypress-integration";s:4:"Slug";s:16:"pmpro-buddypress";s:6:"plugin";s:37:"pmpro-buddypress/pmpro-buddypress.php";s:7:"Version";s:5:"1.3.1";s:11:"Description";s:84:"Restrict access to your BuddyPress or BuddyBoss Community using Paid Memberships Pro";s:12:"Installation";s:4583:"<p>Installation</p><p>Note: You must have <a href="https://wordpress.org/plugins/paid-memberships-pro/">Paid Memberships Pro</a> and <a href="https://wordpress.org/plugins/buddypress/">BuddyPress</a> or <a href="https://www.paidmembershipspro.com/buddyboss-membership-plugin/?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-buddypress">BuddyBoss</a> installed and activated on your site.</p>\n<h3>Install PMPro BuddyPress from within WordPress</h3>\n<ol>\n<li>Visit the plugins page within your dashboard and select "Add New"</li>\n<li>Search for "PMPro BuddyPress"</li>\n<li>Locate this plugin and click "Install"</li>\n<li>Activate "Paid Memberships Pro - BuddyPress Integration" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>Install PMPro BuddyPress Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-buddypress</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate "Paid Memberships Pro - BuddyPress Integration" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>After Activation: Configure Plugin Settings</h3>\n<p>There are four primary settings areas in this plugin.</p><ol>\n<li>Select Your Preferred Registration Process</li>\n</ol><p>This plugin allows you to use the BuddyPress or BuddyBoss user registration process (in place of the standard Paid Memberships Pro membership checkout process).</p>\n<ol>\n<li>Navigate to Memberships &gt; PMPro BuddyPress in the WordPress admin.</li>\n<li>Change the "Registration Page" setting to "Use BuddyPress Registration Page".</li>\n<li>Save Settings.</li>\n</ol>\n<p>Note: If your membership is not free, you must use the Paid Memberships Pro membership checkout process. If you have a free community and want to allow users to register through BuddyPress or BuddyBoss, you must adjust this setting.</p>\n<p>If you\'d like members that register through the BuddyPress or BuddyBoss system to also be given a membership level, check out this guide on <a href="https://www.paidmembershipspro.com/apply-a-buddypress-member-type-on-membership-checkout-or-level-change/?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-buddypress">setting a default level for all user registrations in WordPress</a>.</p><ol start="2">\n<li>Assign the "Access Restricted" Page</li>\n</ol><p>Navigate to Memberships &gt; Settings &gt; Pages to create or edit the "Access Restricted" page.</p>\n<p>This is the page that visitors and users are redirected to if they cannot access restricted BuddyPress or BuddyBoss features.</p><ol start="3">\n<li>Configure Membership Level Settings</li>\n</ol><p>Navigate to Memberships &gt; Settings &gt; Membership Levels and locate the "BuddyPress Restrictions" section.</p>\n<p>From this section you can adjust settings for how you "unlock BuddyPress" for members of this level, including:</p>\n<ul>\n<li>Group Creation</li>\n<li>Single Group Viewing</li>\n<li>Groups Page Viewing</li>\n<li>Joining Groups</li>\n<li>Public Messaging</li>\n<li>Private Messaging</li>\n<li>Send Friend Requests</li>\n<li>Include in Member Directory</li>\n</ul>\n<p>Next, adjust the "BuddyPress Group Membership" settings to add or invite members of this level to your existing BuddyPress Groups.</p>\n<p>If you want to adjust BuddyPress Member Types, you must first create the types through custom code. <a href="https://www.paidmembershipspro.com/apply-a-buddypress-member-type-on-membership-checkout-or-level-change/?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-buddypress">This post explains how to add Member Types to BuddyPress</a>.</p>\n<p><a href="https://www.paidmembershipspro.com/add-ons/buddypress-integration/#members?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-buddypress">Read our full documentation on Membership Level Settings for your BuddyPress or BuddyBoss community here</a>.</p><ol start="4">\n<li>Configure Settings for Logged in Non Members</li>\n</ol><p>Some of your WordPress users may not have a membership level in Paid Memberships Pro. This plugin allows you to set how BuddyPress should be locked down for these users without a membership level.</p>\n<p>Navigate to Memberships &gt; Settings &gt; PMPro BuddyPress and locate the "Non-member User Settings" section.</p>\n<p><a href="https://www.paidmembershipspro.com/add-ons/buddypress-integration/#non_member_user?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-buddypress">Read our full documentation on Non-Member Users in BuddyPress or BuddyBoss here</a>.</p>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:173:"<h4>Changelog</h4><p>1.3.2 - 2022-09-13</p><ul>\n<li>BUG FIX: Fixed an issue from v1.3 that was causing the member directory to constantly be locked in most cases.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:59:"https://downloads.wordpress.org/plugin/pmpro-buddypress.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:22:"BuddyPress & BuddyBoss";}i:16;a:16:{s:4:"Name";s:50:"Paid Memberships Pro - Cancel on Next Payment Date";s:5:"Title";s:50:"Paid Memberships Pro - Cancel on Next Payment Date";s:9:"PluginURI";s:70:"https://www.paidmembershipspro.com/add-ons/cancel-on-next-payment-date";s:4:"Slug";s:33:"pmpro-cancel-on-next-payment-date";s:6:"plugin";s:71:"pmpro-cancel-on-next-payment-date/pmpro-cancel-on-next-payment-date.php";s:7:"Version";s:5:"0.5.1";s:11:"Description";s:105:"Change membership cancellation to set expiration date for next payment instead of cancelling immediately.";s:12:"Installation";s:301:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-cancel-on-next-payment-date</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>That\'s it. This plugin has no additional settings.</li>\n</ol>";s:3:"FAQ";s:343:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-cancel-on-next-payment-date/issues">https://github.com/strangerstudios/pmpro-cancel-on-next-payment-date/issues</a></p>";s:9:"Changelog";s:195:"<h4>Changelog</h4><p>0.5.1 - 2022-08-22</p><ul>\n<li>ENHANCEMENT: Internationalization for the date in the cancellation text string. (This was accidentally left out of the last update.)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:90:"http://license.paidmembershipspro.com/downloads/free/pmpro-cancel-on-next-payment-date.zip";s:7:"License";s:4:"free";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:27:"Cancel on Next Payment Date";}i:17;a:16:{s:4:"Name";s:37:"Paid Memberships Pro - CCBill Gateway";s:5:"Title";s:37:"Paid Memberships Pro - CCBill Gateway";s:9:"PluginURI";s:49:"https://www.paidmembershipspro.com/add-ons/ccbill";s:4:"Slug";s:12:"pmpro-ccbill";s:6:"plugin";s:29:"pmpro-ccbill/pmpro-ccbill.php";s:7:"Version";s:3:"0.5";s:11:"Description";s:36:"PMPro Gateway integration for CCBill";s:12:"Installation";s:533:"<p>Installation</p><ol>\n<li>Make sure you have the Paid Memberships Pro plugin installed and activated.</li>\n<li>Upload the <code>pmpro-ccbill</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\n<p>Navigate to Memberships &gt; Settings &gt; Payment Gateways &amp; SSL and select the CCBill payment gateway. You will then need to fill out the required account credentials to connect your website to the payment gateway.</p>";s:3:"FAQ";s:493:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-ccbill/issues">https://github.com/strangerstudios/pmpro-ccbill/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:429:"<h4>Changelog</h4><p>0.5 - 2024-07-15</p><ul>\n<li>ENHANCEMENT: Added improved support for renewals and renewal failures. (Thanks @misfist for your contribution)</li>\n<li>ENHANCEMENT: Added support for "Expired" webhook event types, when a subscription has expired. (@andrewlimaza)</li>\n<li>REFACTOR: Adjusted the HTML for the checkout button to support newer versions of PMPro and improved accessibility. (@kimcoleman)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:69:"http://license.paidmembershipspro.com/downloads/free/pmpro-ccbill.zip";s:7:"License";s:4:"free";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:14:"CCBill Gateway";}i:18;a:16:{s:4:"Name";s:42:"Paid Memberships Pro - Check Levels Add On";s:5:"Title";s:42:"Paid Memberships Pro - Check Levels Add On";s:9:"PluginURI";s:56:"http://www.paidmembershipspro.com/wp/pmpro-check-levels/";s:4:"Slug";s:18:"pmpro-check-levels";s:6:"plugin";s:41:"pmpro-check-levels/pmpro-check-levels.php";s:7:"Version";s:2:".3";s:11:"Description";s:106:"A collection of customizations useful when allowing users to pay by check for Paid Memberships Pro levels.";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:30:"http://www.strangerstudios.com";s:8:"Download";s:76:"https://license.paidmembershipspro.com/downloads/plus/pmpro-check-levels.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:12:"Check Levels";}i:19;a:16:{s:4:"Name";s:39:"Connect Paid Memberships Pro to Discord";s:5:"Title";s:39:"Connect Paid Memberships Pro to Discord";s:9:"PluginURI";s:132:"https://www.expresstechsoftwares.com/step-by-step-documentation-guide-on-how-to-connect-pmpro-and-discord-server-using-discord-addon";s:4:"Slug";s:20:"pmpro-discord-add-on";s:6:"plugin";s:45:"pmpro-discord-add-on/pmpro-discord-add-on.php";s:7:"Version";s:5:"1.2.8";s:11:"Description";s:108:"Connect your PaidMebershipPro site to your discord server, enable your members to be part of your community.";s:12:"Installation";s:862:"<p>Installation</p><p>Download, Install and Activate!</p><ol>\n<li>Go to Plugins &gt; Add New to find and install PMPRO discord Addon.</li>\n<li>Or, download the latest version of the plugin, then go to Plugins &gt; Add New and click the "Upload Plugin" button to upload your .zip file.</li>\n<li>Activate the plugin.</li>\n</ol><p>Complete the Initial Plugin Setup</p><p>Go to Memberships &gt; Discord Settings in the WordPress admin to begin setup. Our <a href="https://youtu.be/v7lxB_Bvlv4">Initial Setup Tutorial Video </a> will show you how to configure</p><p>More Installation and Setup Documentation</p><ul>\n<li><a href="https://youtu.be/v7lxB_Bvlv4">Installation Video</a></li>\n<li><a href="https://www.expresstechsoftwares.com/step-by-step-documentation-guide-on-how-to-connect-pmpro-and-discord-server-using-discord-addon/">Installation Docs</a></li>\n</ul>";s:3:"FAQ";s:471:"<p>Frequently Asked Questions</p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit <a href="https://www.expresstechsoftwares.com/step-by-step-documentation-guide-on-how-to-connect-pmpro-and-discord-server-using-discord-addon/">our support site at https://www.expresstechsoftwares.com/step-by-step-documentation-guide-on-how-to-connect-pmpro-and-discord-server-using-discord-addon/</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:0:"";s:6:"Author";s:59:"ExpressTech Software Solutions Pvt. Ltd., Strangers Studios";s:9:"AuthorURI";s:36:"https://www.expresstechsoftwares.com";s:8:"Download";s:63:"https://downloads.wordpress.org/plugin/pmpro-discord-add-on.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:39:"Connect Paid Memberships Pro to Discord";}i:20;a:16:{s:4:"Name";s:46:"Paid Memberships Pro - Constant Contact Add On";s:5:"Title";s:46:"Paid Memberships Pro - Constant Contact Add On";s:9:"PluginURI";s:56:"http://www.paidmembershipspro.com/pmpro-constantcontact/";s:4:"Slug";s:22:"pmpro-constant-contact";s:6:"plugin";s:49:"pmpro-constant-contact/pmpro-constant-contact.php";s:7:"Version";s:5:"1.0.2";s:11:"Description";s:66:"Sync your WordPress users and members with Constant Contact lists.";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:30:"http://www.strangerstudios.com";s:8:"Download";s:65:"https://downloads.wordpress.org/plugin/pmpro-constant-contact.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:16:"Constant Contact";}i:21;a:16:{s:4:"Name";s:45:"Paid Memberships Pro - ConvertKit Integration";s:5:"Title";s:45:"Paid Memberships Pro - ConvertKit Integration";s:9:"PluginURI";s:53:"https://www.paidmembershipspro.com/add-ons/convertkit";s:4:"Slug";s:35:"convertkit-for-paid-memberships-pro";s:6:"plugin";s:75:"convertkit-for-paid-memberships-pro/convertkit-for-paid-memberships-pro.php";s:7:"Version";s:5:"1.1.0";s:11:"Description";s:66:"Subscribe and tag your Paid Memberships Pro members in ConvertKit.";s:12:"Installation";s:865:"<p>Installation</p><p>Download, Install and Activate!</p><ol>\n<li>Go to Plugins &gt; Add New to find and install ConvertKit Paid Memberships Pro Integration.</li>\n<li>Or, download the latest version of the plugin, then go to Plugins &gt; Add New and click the "Upload Plugin" button to upload your .zip file.</li>\n<li>Activate the plugin.</li>\n</ol><p>Complete the ConvertKit Integration Setup</p><p>Go to Settings &gt; PMPro ConvertKit in the WordPress admin to begin setup.</p>\n<ol>\n<li>Enter your ConvertKit API key, which you can find <a href="https://app.convertkit.com/account/edit">here</a>.</li>\n<li>To add purchase data for subscribers, enter your ConvertKit Secret API key.</li>\n<li>Save your settings.</li>\n<li>Then, adjust the dropdown fields to select a tag for subscribers who sign up for each Membership Level.</li>\n<li>Save your settings.</li>\n</ol>";s:3:"FAQ";s:155:"<p>Frequently Asked Questions</p><p>Does this plugin require a paid service?</p><p>Yes, for it to work you must first have an account on ConvertKit.com</p>";s:9:"Changelog";s:857:"<h4>Changelog</h4><p>1.1 - 2021-06-21</p><ul>\n<li>FEATURE: Updated opt-in settings. You can edit the label shown on the opt-in message at checkout.</li>\n<li>FEATURE: Added purchase tracking for each level in ConvertKit.</li>\n<li>ENHANCEMENT: Added assets for GitHub and WordPress.org.</li>\n<li>ENHANCEMENT: Added field to capture API Secret Key.</li>\n<li>ENHANCEMENT: Added Purchases tracking for new membership checkouts.</li>\n<li>ENHANCEMENT: Added filter <code>pmpro_convertkit_change_membership_level_remove_tags</code> to allow optionally removing tags on level change when the previous level is passed to the pmpro_after_change_membership_level function.</li>\n<li>BUG FIX: Email addresses and names are now properly URL encoded when passed to ConvertKit.</li>\n<li>REFACTOR: Refactored API method for retrieving tags and tagging subscribers.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:78:"https://downloads.wordpress.org/plugin/convertkit-for-paid-memberships-pro.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:22:"ConvertKit Integration";}i:22;a:16:{s:4:"Name";s:52:"Paid Memberships Pro - Courses for Membership Add On";s:5:"Title";s:52:"Paid Memberships Pro - Courses for Membership Add On";s:9:"PluginURI";s:73:"https://www.paidmembershipspro.com/add-ons/pmpro-courses-lms-integration/";s:4:"Slug";s:13:"pmpro-courses";s:6:"plugin";s:31:"pmpro-courses/pmpro-courses.php";s:7:"Version";s:5:"1.2.5";s:11:"Description";s:89:"Create courses and lessons for members. Integrates LMS plugins with Paid Memberships Pro.";s:12:"Installation";s:2216:"<p>Installation</p><p>Note: You must have <a href="https://wordpress.org/plugins/paid-memberships-pro/">Paid Memberships Pro</a> installed and activated on your site.</p>\n<h3>Install PMPro Courses from within WordPress</h3>\n<ol>\n<li>Visit the plugins page within your dashboard and select "Add New"</li>\n<li>Search for "PMPro Courses"</li>\n<li>Locate this plugin and click "Install"</li>\n<li>Activate "Paid Memberships Pro - Courses for Membership" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>Install PMPro Courses Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-courses</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate "Paid Memberships Pro - Courses for Membership" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>After Activation: Configure Course Modules</h3>\n<p>Navigate to Memberships &gt; Courses in the WordPress admin to configure modules.</p>\n<p>The Courses settings page controls which modules are active in your membership site. In most cases, you will only need to have one module active at a time. Navigate to Memberships &gt; Courses to choose from the following settings:</p>\n<ol>\n<li>Default Module: Use the built-in course and lesson custom post types to build a basic e-learning component in your WordPress membership site.</li>\n<li>LearnDash: Enable the LearnDash module to enable course protection by membership level for your courses in the LearnDash LMS.</li>\n<li>LifterLMS: Enable the LifterLMS module to enable course protection by membership level for your courses in LifterLMS.</li>\n</ol>\n<p>Note: This Add On does not include any update scripts to manage enrollment for existing members. For the LearnDash and LifterLMS modules, all members who have an existing membership level will not be automatically enrolled in courses. Course protection and enrollment is hooked in the level change event: only new members or members that cancel or change their level will be updated. You must manually add and remove current members from protected courses.</p>\n<p>The default (built-in) module does not rely on enrollment and will not require any update script.</p>";s:3:"FAQ";s:543:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-courses/issues">https://github.com/strangerstudios/pmpro-courses/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit <a href="http://www.paidmembershipspro.com/">our support site at https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:143:"<h4>Changelog</h4><p>1.2.5 - 2023-08-04</p><ul>\n<li>SECURITY: Sanitizing options when saving to the database for activating modules.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:56:"https://downloads.wordpress.org/plugin/pmpro-courses.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:22:"Courses for Membership";}i:23;a:16:{s:4:"Name";s:52:"Paid Memberships Pro - Custom Level Cost Text Add On";s:5:"Title";s:52:"Paid Memberships Pro - Custom Level Cost Text Add On";s:9:"PluginURI";s:72:"https://www.paidmembershipspro.com/add-ons/pmpro-custom-level-cost-text/";s:4:"Slug";s:21:"pmpro-level-cost-text";s:6:"plugin";s:47:"pmpro-level-cost-text/pmpro-level-cost-text.php";s:7:"Version";s:5:"0.4.2";s:11:"Description";s:99:"Modify the default level cost text per level, per discount code, or globally via advanced settings.";s:12:"Installation";s:361:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-level-cost-text</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Edit a Membership Level, Discount Code or the Memberships &gt; Advanced Settings page to modify generated level cost text.</li>\n</ol>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:35:"https://www.paidmembershipspro.com/";s:8:"Download";s:82:"http://license.paidmembershipspro.com/downloads/standard/pmpro-level-cost-text.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:22:"Custom Level Cost Text";}i:24;a:16:{s:4:"Name";s:46:"Paid Memberships Pro - Custom Post Type Add On";s:5:"Title";s:46:"Paid Memberships Pro - Custom Post Type Add On";s:9:"PluginURI";s:78:"https://www.paidmembershipspro.com/add-ons/custom-post-type-membership-access/";s:4:"Slug";s:9:"pmpro-cpt";s:6:"plugin";s:23:"pmpro-cpt/pmpro-cpt.php";s:7:"Version";s:5:"1.0.1";s:11:"Description";s:76:"Add the PMPro meta box to CPTs and redirects non-members to a selected page.";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:35:"https://www.paidmembershipspro.com/";s:8:"Download";s:70:"http://license.paidmembershipspro.com/downloads/standard/pmpro-cpt.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:16:"Custom Post Type";}i:25;a:16:{s:4:"Name";s:49:"Paid Memberships Pro - Developer\'s Toolkit Add On";s:5:"Title";s:49:"Paid Memberships Pro - Developer\'s Toolkit Add On";s:9:"PluginURI";s:57:"https://www.paidmembershipspro.com/add-ons/pmpro-toolkit/";s:4:"Slug";s:13:"pmpro-toolkit";s:6:"plugin";s:31:"pmpro-toolkit/pmpro-toolkit.php";s:7:"Version";s:5:"0.8.1";s:11:"Description";s:70:"Various tools to test and debug Paid Memberships Pro enabled websites.";s:12:"Installation";s:221:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-toolkit</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:303:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-toolkit/issues">https://github.com/strangerstudios/pmpro-toolkit/issues</a></p>";s:9:"Changelog";s:143:"<h4>Changelog</h4><p>0.8.1 - 2023-04-08</p><ul>\n<li>BUG FIX: Fixed issue where the checkout debug feature interfered with redirects.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:74:"http://license.paidmembershipspro.com/downloads/standard/pmpro-toolkit.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:19:"Developer\'s Toolkit";}i:26;a:16:{s:4:"Name";s:32:"Paid Memberships Pro - Donations";s:5:"Title";s:32:"Paid Memberships Pro - Donations";s:9:"PluginURI";s:60:"https://www.paidmembershipspro.com/add-ons/donations-add-on/";s:4:"Slug";s:15:"pmpro-donations";s:6:"plugin";s:35:"pmpro-donations/pmpro-donations.php";s:7:"Version";s:3:"2.1";s:11:"Description";s:65:"Allow customers to set an additional donation amount at checkout.";s:12:"Installation";s:310:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-donations</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Edit the levels you want to add donations to and set the "Donation" settings.</li>\n</ol>";s:3:"FAQ";s:307:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-donations/issues">https://github.com/strangerstudios/pmpro-donations/issues</a></p>";s:9:"Changelog";s:670:"<h4>Changelog</h4><p>2.1 - 2024-07-16</p><ul>\n<li>ENHANCEMENT: Updated styling for compatibility with PMPro v3.1 including moving the "Make a Gift" field to its own checkout box. #75 (@dparker1005, @kimcoleman)</li>\n<li>BUG FIX/ENHANCEMENT: Optimized reverse-compatibiliy code for donation amounts stored in order notes that could cause performance during bulk order processing. #74 (@JarrydLong)</li>\n<li>BUG FIX/ENHANCEMENT: Localized the "other" dropdown option at checkout. #71 (@mircobabini)</li>\n<li>BUG FIX: Fixed issue where the <code>pmpro_donations_invoice_bullets</code> filter would not alter the bullets on the PMPro Invoice page. #73 (@dwanjuki)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:35:"https://www.paidmembershipspro.com/";s:8:"Download";s:72:"http://license.paidmembershipspro.com/downloads/plus/pmpro-donations.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:9:"Donations";}i:27;a:16:{s:4:"Name";s:58:"Paid Memberships Pro - Download Monitor Integration Add On";s:5:"Title";s:58:"Paid Memberships Pro - Download Monitor Integration Add On";s:9:"PluginURI";s:57:"http://www.paidmembershipspro.com/pmpro-download-monitor/";s:4:"Slug";s:22:"pmpro-download-monitor";s:6:"plugin";s:49:"pmpro-download-monitor/pmpro-download-monitor.php";s:7:"Version";s:4:".2.1";s:11:"Description";s:72:"Require membership for downloads when using the Download Monitor plugin.";s:12:"Installation";s:1367:"<p>Installation</p><p>Prerequisites</p><ol>\n<li>You must have Paid Memberships Pro and Download Monitor installed and activated on your site.</li>\n</ol><p>Download, Install and Activate!</p><ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-download-monitor/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>How to Use</p><ol>\n<li>After activation, navigate to "Downloads" to Edit or Add a New Download.</li>\n<li>Check the box for each level that can access this download in the "Require Membership" meta box (below the Publish box in the right sidebar). </li>\n<li>Save your changes by clicking the "Update" button (or "Publish" if you are creating a new download).</li>\n</ol>\n<p>When using the [download] shortcode you can optionally specify the appropriate "pmpro" template. Available templates include: "pmpro", "pmpro_box", "pmpro_button", "pmpro_filename", "pmpro_title".</p>\n<p>If you do not specify a template, the output of the [download] shortcode can be filtered for a non-member by using the filter: pmprodlm_shortcode_download_content_filter. This will alter the message shown to a visitor that is not logged in or a logged in user that doesn\'t meet membership requirements.</p>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:152:"<h4>Changelog</h4><p>.2.1</p><ul>\n<li>BUG FIX: Using the get_id() method to get the id of downloads now that the -&gt;id property is private.</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:30:"http://www.strangerstudios.com";s:8:"Download";s:79:"http://license.paidmembershipspro.com/downloads/free/pmpro-download-monitor.zip";s:7:"License";s:4:"free";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:28:"Download Monitor Integration";}i:28;a:16:{s:4:"Name";s:48:"Paid Memberships Pro - Email Confirmation Add On";s:5:"Title";s:48:"Paid Memberships Pro - Email Confirmation Add On";s:9:"PluginURI";s:69:"https://www.paidmembershipspro.com/add-ons/email-confirmation-add-on/";s:4:"Slug";s:24:"pmpro-email-confirmation";s:6:"plugin";s:53:"pmpro-email-confirmation/pmpro-email-confirmation.php";s:7:"Version";s:3:"0.8";s:11:"Description";s:73:"Require email confirmation before certain levels are enabled for members.";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:35:"https://www.paidmembershipspro.com/";s:8:"Download";s:85:"http://license.paidmembershipspro.com/downloads/standard/pmpro-email-confirmation.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:18:"Email Confirmation";}i:29;a:16:{s:4:"Name";s:45:"Paid Memberships Pro - Email Templates Add On";s:5:"Title";s:45:"Paid Memberships Pro - Email Templates Add On";s:9:"PluginURI";s:72:"https://www.paidmembershipspro.com/add-ons/email-templates-admin-editor/";s:4:"Slug";s:21:"pmpro-email-templates";s:6:"plugin";s:47:"pmpro-email-templates/pmpro-email-templates.php";s:7:"Version";s:5:"0.8.1";s:11:"Description";s:114:"Customize member emails for Paid Memberships Pro using an interactive admin editor within the WordPress dashboard.";s:12:"Installation";s:333:"<h4>Installation</h4><p>Installation</p><ol>\n<li>Upload the <code>pmpro-email-templates</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to Memberships &gt; Email Templates to begin customizing emails.</li>\n</ol>";s:3:"FAQ";s:354:"<h4>Frequently Asked Questions</h4><p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-email-templates/issues">https://github.com/strangerstudios/pmpro-email-templates/issues</a></p>";s:9:"Changelog";s:153:"<h4>Changelog</h4><p>0.8.1 - 2020-06-04</p><ul>\n<li>BUG Fix: Fixed issue where !!membership_change!! may not show user\'s new membership level.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:79:"https://license.paidmembershipspro.com/downloads/plus/pmpro-email-templates.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:15:"Email Templates";}i:30;a:16:{s:4:"Name";s:36:"Paid Memberships Pro - Events Add On";s:5:"Title";s:36:"Paid Memberships Pro - Events Add On";s:9:"PluginURI";s:67:"https://www.paidmembershipspro.com/add-ons/events-for-members-only/";s:4:"Slug";s:12:"pmpro-events";s:6:"plugin";s:29:"pmpro-events/pmpro-events.php";s:7:"Version";s:3:"1.5";s:11:"Description";s:65:"Offer Members-only events using PMPro and popular events plugins.";s:12:"Installation";s:1936:"<p>Installation</p><p>Note: You must have <a href="https://wordpress.org/plugins/paid-memberships-pro/">Paid Memberships Pro</a> installed and activated on your site.</p>\n<h3>Install PMPro Events from within WordPress</h3>\n<ol>\n<li>Visit the plugins page within your dashboard and select "Add New"</li>\n<li>Search for "PMPro Events"</li>\n<li>Locate this plugin and click "Install"</li>\n<li>Activate "Paid Memberships Pro - Events" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>Install PMPro Events Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-events</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate "Paid Memberships Pro - Events" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>After Activation: Create Members-Only Events</h3>\n<p>Once the plugin is activated, it automatically detects which events module to load for your site. The included modules are:</p>\n<ul>\n<li><a href="https://wordpress.org/plugins/events-manager/">Events Manager</a></li>\n<li><a href="https://wordpress.org/plugins/the-events-calendar/">The Events Calendar</a></li>\n<li><a href="https://wordpress.org/plugins/sugar-calendar-lite/">Sugar Calendar</a></li>\n<li><a href="https://wordpress.org/plugins/all-in-one-event-calendar/">Timely All-in-One Events Calendar (&lt; 3.0.0)</a></li>\n</ul>\n<p>If you are not already using an events plugin, you must select one from this list to use the features of this integration plugin.</p>\n<ol>\n<li>Edit any event in your site to restrict access via the "Require Membership" meta box.</li>\n<li>Events are displayed or hidden from calendar (archive) view according to your settings under Memberships &gt; Settings &gt; Advanced Settings.</li>\n<li>Event excerpts are shown or hidden from non-members according to your settings under Memberships &gt; Settings &gt; Advanced Settings.</li>\n</ol>";s:3:"FAQ";s:693:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-events/issues">https://github.com/strangerstudios/pmpro-events/issues</a></p>\n<p>For immediate help, also post to our premium support site at <a href="https://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:606:"<h4>Changelog</h4><p>1.5 - 2024-07-18</p><ul>\n<li>ENHANCEMENT: Updated the frontend UI for compatibility with PMPro v3.1. #53 (@dparker1005)</li>\n<li>ENHANCEMENT: Only load our module for All-In-One-Events Calendar for versions before 3.0. If you are using the latest version, please restrict the content by following this guide - <a href="https://www.paidmembershipspro.com/documentation/content-controls/">https://www.paidmembershipspro.com/documentation/content-controls/</a></li>\n<li>REFACTOR: Now usigng <code>get_option()</code> instead of <code>pmpro_getOption()</code>. #51 (@JarrydLong)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:55:"https://downloads.wordpress.org/plugin/pmpro-events.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:6:"Events";}i:31;a:16:{s:4:"Name";s:61:"Paid Memberships Pro - Extra Expiration Warning Emails Add On";s:5:"Title";s:61:"Paid Memberships Pro - Extra Expiration Warning Emails Add On";s:9:"PluginURI";s:82:"https://www.paidmembershipspro.com/add-ons/extra-expiration-warning-emails-add-on/";s:4:"Slug";s:37:"pmpro-extra-expiration-warning-emails";s:6:"plugin";s:79:"pmpro-extra-expiration-warning-emails/pmpro-extra-expiration-warning-emails.php";s:7:"Version";s:3:"1.0";s:11:"Description";s:81:"Send out more than one "membership expiration warning" email to users with PMPro.";s:12:"Installation";s:386:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-extra-expiration-warning-emails</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the <code>Plugins</code> menu in WordPress.</li>\n<li>Update the $emails array to change when the additional emails are sent and to define a custom template file, if desired.</li>\n</ol>";s:3:"FAQ";s:597:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-extra-expiration-warning-emails/issues">https://github.com/strangerstudios/pmpro-extra-expiration-warning-emails/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:1009:"<h4>Changelog</h4><p>1.0 - 2023-12-20</p><ul>\n<li>ENHANCEMENT: Updated how the plugin tracks which emails have already been sent. This should fix issues where emails would not be sent out consistently, but may cause users to recieve an additional email immediately upon upgrade.</li>\n<li>ENHANCEMENT: Added a new constant <code>PMPROEEWE_DEBUG</code> to allow setting an email address to send log data to or to have the log data printed to a file. #33 (@andrewlimaza, @dparker1005)</li>\n<li>ENHANCEMENT: Now passing the user object to the <code>pmproeewe_send_reminder_to_user</code> filter. #25 (@contemplate)</li>\n<li>ENHANCEMENT: Added localization support.</li>\n<li>ENHANCEMENT: Now tracking the time that notifications are sent to more accurately send future notifications.</li>\n<li>BUG FIX/ENHANCEMENT: Now compatible with PMPro Multiple Memberships Per User. #30 (@dparker1005)</li>\n<li>REFACTOR: Now using <code>get_option()</code> instead of <code>pmpro_getOption()</code>. #32 (@dwanjuki)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:98:"http://license.paidmembershipspro.com/downloads/standard/pmpro-extra-expiration-warning-emails.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:31:"Extra Expiration Warning Emails";}i:32;a:16:{s:4:"Name";s:50:"Paid Memberships Pro - Failed Payment Limit Add On";s:5:"Title";s:50:"Paid Memberships Pro - Failed Payment Limit Add On";s:9:"PluginURI";s:64:"http://www.paidmembershipspro.com/wp/pmpro-failed-payment-limit/";s:4:"Slug";s:26:"pmpro-failed-payment-limit";s:6:"plugin";s:57:"pmpro-failed-payment-limit/pmpro-failed-payment-limit.php";s:7:"Version";s:2:".3";s:11:"Description";s:55:"Cancel members subscriptions after 1-3 failed payments.";s:12:"Installation";s:433:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-failed-payment-limit</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Visit Memberships -&gt; Advanced Settings to change the "Failed Payment Limit" setting.</li>\n<li>Alternatively, you can set a PMPRO_FAILED_PAYMENT_LIMIT constant in your wp-config.php file.</li>\n</ol>";s:3:"FAQ";s:329:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-failed-payment-limit/issues">https://github.com/strangerstudios/pmpro-failed-payment-limit/issues</a></p>";s:9:"Changelog";s:431:"<h4>Changelog</h4><p>0.3 - 2023-10-12</p><ul>\n<li>BUG FIX/ENHANCEMENT: Marking plugin as incompatible with Multiple Memberships Per User for the PMPro v3.0 update. #14 (@dparker1005)</li>\n<li>BUG FIX: Now passing user object to <code>sendCancelEmail()</code> instead of just the user ID. #10 (@mircobabini)</li>\n<li>REFACTOR: Now using <code>get_option()</code> instead of <code>pmpro_getOption()</code>. #15 (@dwanjuki)</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:30:"http://www.strangerstudios.com";s:8:"Download";s:83:"http://license.paidmembershipspro.com/downloads/plus/pmpro-failed-payment-limit.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:20:"Failed Payment Limit";}i:33;a:16:{s:4:"Name";s:41:"Paid Memberships Pro - GetResponse Add On";s:5:"Title";s:41:"Paid Memberships Pro - GetResponse Add On";s:9:"PluginURI";s:52:"http://www.paidmembershipspro.com/pmpro-getresponse/";s:4:"Slug";s:17:"pmpro-getresponse";s:6:"plugin";s:39:"pmpro-getresponse/pmpro-getresponse.php";s:7:"Version";s:2:".5";s:11:"Description";s:65:"Sync your WordPress users and members with GetResponse campaigns.";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:30:"http://www.strangerstudios.com";s:8:"Download";s:75:"https://license.paidmembershipspro.com/downloads/plus/pmpro-getresponse.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:11:"GetResponse";}i:34;a:16:{s:4:"Name";s:38:"Paid Memberships Pro - Gift Aid Add On";s:5:"Title";s:38:"Paid Memberships Pro - Gift Aid Add On";s:9:"PluginURI";s:52:"https://www.paidmembershipspro.com/add-ons/gift-aid/";s:4:"Slug";s:14:"pmpro-gift-aid";s:6:"plugin";s:33:"pmpro-gift-aid/pmpro-gift-aid.php";s:7:"Version";s:4:".1.2";s:11:"Description";s:87:"Add a Checkbox to Opt In to the UK “Gift Aid” Tax-Incentive on Membership Checkout.";s:12:"Installation";s:309:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-gift-aid</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Edit the levels you want to add donations to and set the "Donation" settings.</li>\n</ol>";s:3:"FAQ";s:305:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-gift-aid/issues">https://github.com/strangerstudios/pmpro-gift-aid/issues</a></p>";s:9:"Changelog";s:160:"<h4>Changelog</h4><p>.1.2</p><ul>\n<li>BUG FIX: Fixed issue where gift aid data wasn\'t being saved into user meta after checkout with PayPal Standard.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:71:"http://license.paidmembershipspro.com/downloads/plus/pmpro-gift-aid.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:8:"Gift Aid";}i:35;a:16:{s:4:"Name";s:41:"Paid Memberships Pro - Gift Levels Add On";s:5:"Title";s:41:"Paid Memberships Pro - Gift Levels Add On";s:9:"PluginURI";s:61:"https://www.paidmembershipspro.com/add-ons/pmpro-gift-levels/";s:4:"Slug";s:17:"pmpro-gift-levels";s:6:"plugin";s:39:"pmpro-gift-levels/pmpro-gift-levels.php";s:7:"Version";s:3:"1.1";s:11:"Description";s:86:"Sell a gift certificate that generates a unique gift code for membership to your site.";s:12:"Installation";s:640:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-gift-levels</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to Memberships &gt; Settings &gt; Levels to create and manage gift membership levels.</li>\n<li>Navigate to Memberships &gt; Settings &gt; Email Templates to modify default messages sent through this plugin.</li>\n</ol>\n<p>Refer to the <a href="https://www.paidmembershipspro.com/add-ons/pmpro-gift-levels/">Gift Levels Add On documentation page</a> for more information on how to set up your gift levels.</p>";s:3:"FAQ";s:33:"<p>Frequently Asked Questions</p>";s:9:"Changelog";s:387:"<h4>Changelog</h4><p>1.1 - 2024-07-31</p><ul>\n<li>ENHANCEMENT: Updated the frontend UI for compatibility with PMPro v3.1. #71 (@dparker1005, @kimcoleman)</li>\n<li>BUG FIX: Fixed conflict with the PMPro Pay By Check Add On. #70 (@dparker1005)</li>\n<li>DEPRECATED: Removed <code>sample-setup.php</code> as settings can now be configured on the Edit Level page. #72 (@kimcoleman)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:74:"http://license.paidmembershipspro.com/downloads/plus/pmpro-gift-levels.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:11:"Gift Levels";}i:36;a:16:{s:4:"Name";s:47:"Paid Memberships Pro - Goal Progress Bar Add On";s:5:"Title";s:47:"Paid Memberships Pro - Goal Progress Bar Add On";s:9:"PluginURI";s:55:"https://www.paidmembershipspro.com/add-ons/pmpro-goals/";s:4:"Slug";s:11:"pmpro-goals";s:6:"plugin";s:27:"pmpro-goals/pmpro-goals.php";s:7:"Version";s:3:"1.2";s:11:"Description";s:68:"Display a progress bar for membership site signup and revenue goals.";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:68:"http://license.paidmembershipspro.com/downloads/plus/pmpro-goals.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:17:"Goal Progress Bar";}i:37;a:16:{s:4:"Name";s:51:"Paid Memberships Pro - Google Analytics Integration";s:5:"Title";s:51:"Paid Memberships Pro - Google Analytics Integration";s:9:"PluginURI";s:60:"https://www.paidmembershipspro.com/add-ons/google-analytics/";s:4:"Slug";s:22:"pmpro-google-analytics";s:6:"plugin";s:49:"pmpro-google-analytics/pmpro-google-analytics.php";s:7:"Version";s:5:"1.0.1";s:11:"Description";s:111:"Connect Paid Memberships Pro to Google Analytics 4 to measure traffic, interactions, and ecommerce conversions.";s:12:"Installation";s:1008:"<p>Installation</p><p>Prerequisites</p><ol>\n<li>You must have Paid Memberships Pro installed and activated on your site.</li>\n</ol><p>Download, Install and Activate!</p><ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-google-analytics/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>How to Use</p><ol>\n<li>Navigate to Settings &gt; PMPro Google Analytics.</li>\n<li>Enter your Google Analytics Property\'s Measurement ID </li>\n<li>Define settings for membership levels to track (including free checkouts) or leave blank to track all ecommerce conversions.</li>\n<li>Optionally exclude administrator role users from tracking.</li>\n<li>Save Settings.</li>\n</ol>\n<p>View full documentation at: <a href="https://www.paidmembershipspro.com/add-ons/google-analytics/">https://www.paidmembershipspro.com/add-ons/google-analytics/</a></p>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:180:"<h4>Changelog</h4><p>1.0.1 - 2024-03-12</p><ul>\n<li>BUG FIX: Fixed an issue where the user ID wasn\'t being passed to Analytics correctly for logged-in users. (@dwanjuki)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:83:"http://license.paidmembershipspro.com/downloads/standard/pmpro-google-analytics.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:28:"Google Analytics Integration";}i:38;a:16:{s:4:"Name";s:44:"Paid Memberships Pro - Group Accounts Add On";s:5:"Title";s:44:"Paid Memberships Pro - Group Accounts Add On";s:9:"PluginURI";s:58:"https://www.paidmembershipspro.com/add-ons/group-accounts/";s:4:"Slug";s:20:"pmpro-group-accounts";s:6:"plugin";s:45:"pmpro-group-accounts/pmpro-group-accounts.php";s:7:"Version";s:3:"1.1";s:11:"Description";s:108:"Sell group memberships where one member pays for a collection of people to access your content individually.";s:12:"Installation";s:626:"<p>Installation</p><p>Prerequisites</p><ol>\n<li>You must have Paid Memberships Pro installed and activated on your site.</li>\n</ol><p>Download, Install and Activate!</p><ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-group-accounts/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\n<p>View full documentation at: <a href="https://www.paidmembershipspro.com/add-ons/group-accounts/">https://www.paidmembershipspro.com/add-ons/group-accounts/</a></p>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:279:"<h4>Changelog</h4><p>1.1 - 2024-07-18</p><ul>\n<li>ENHANCEMENT: Updated UI for compatibility with PMPro v3.1. #43 (@dparker1005, @kimcoleman)</li>\n<li>BUG FIX/ENHANCEMENT: Adding the <code>pmpro_alter_price</code> class to the "seats" field at checkout. #39 (@dwanjuki)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:77:"http://license.paidmembershipspro.com/downloads/plus/pmpro-group-accounts.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:14:"Group Accounts";}i:39;a:16:{s:4:"Name";s:50:"Paid Memberships Pro - Group Discount Codes Add On";s:5:"Title";s:50:"Paid Memberships Pro - Group Discount Codes Add On";s:9:"PluginURI";s:64:"https://www.paidmembershipspro.com/add-ons/group-discount-codes/";s:4:"Slug";s:26:"pmpro-group-discount-codes";s:6:"plugin";s:57:"pmpro-group-discount-codes/pmpro-group-discount-codes.php";s:7:"Version";s:3:"0.4";s:11:"Description";s:98:"Adds features to PMPro to better manage grouped discount codes or large numbers of discount codes.";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:35:"https://www.paidmembershipspro.com/";s:8:"Download";s:83:"http://license.paidmembershipspro.com/downloads/plus/pmpro-group-discount-codes.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:20:"Group Discount Codes";}i:40;a:16:{s:4:"Name";s:30:"Hide Admin Bar From Non-admins";s:5:"Title";s:30:"Hide Admin Bar From Non-admins";s:9:"PluginURI";s:74:"https://www.paidmembershipspro.com/add-ons/hide-admin-bar-from-non-admins/";s