ust have an invite code to sign up for certain levels. Users are given an invite code to share.";s:12:"Installation";s:647:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-invite-only</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Set the $pmproio_invite_required_levels array to specify the levels which should require invite codes and generate them and (optionally) set the $pmproio_invite_given_levels if only specific levels should be given invite codes to share.</li>\n<li>Other optional settings: PMPROIO_CODES and PMPROIO_CODES_USES constants can be set to define the number of codes to generate and number of uses code allowed per code.</li>\n</ol>";s:3:"FAQ";s:311:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-invite-only/issues">https://github.com/strangerstudios/pmpro-invite-only/issues</a></p>";s:9:"Changelog";s:593:"<h4>Changelog</h4><p>0.3.5 - 2023-08-21</p><ul>\n<li>ENHANCEMENT: Updating <code>&lt;h3&gt;</code> tags to <code>&lt;h2&gt;</code> tags for better accessibility. #27 (@michaelbeil)</li>\n<li>BUG FIX/ENHANCEMENT: Improved compatibility with PMPro Multiple Memberships Per User Add On. #22 (@dparker1005)</li>\n<li>BUG FIX/ENHANCEMENT: Updated localization and escaping of strings. #28 (@dparker1005)</li>\n<li>BUG FIX: Fixes PHP error that gets thrown on archive pages. #24 (@JarrydLong)</li>\n<li>REFACTOR: No longer pulling level from <code>$_REQUEST</code> variable. #26 (@dparker1005)</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:30:"http://www.strangerstudios.com";s:8:"Download";s:74:"http://license.paidmembershipspro.com/downloads/plus/pmpro-invite-only.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:11:"Invite Only";}i:46;a:16:{s:4:"Name";s:41:"Paid Memberships Pro - Kissmetrics Add On";s:5:"Title";s:41:"Paid Memberships Pro - Kissmetrics Add On";s:9:"PluginURI";s:0:"";s:4:"Slug";s:17:"pmpro-kissmetrics";s:6:"plugin";s:39:"pmpro-kissmetrics/pmpro-kissmetrics.php";s:7:"Version";s:4:".3.1";s:11:"Description";s:116:"Integrates your WordPress site with Kissmetrics to track meaningful user data, with or without Paid Memberships Pro.";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:26:"http://strangerstudios.com";s:8:"Download";s:60:"https://downloads.wordpress.org/plugin/pmpro-kissmetrics.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:11:"Kissmetrics";}i:47;a:16:{s:4:"Name";s:50:"Paid Memberships Pro - Levels as DIV Layout Add On";s:5:"Title";s:50:"Paid Memberships Pro - Levels as DIV Layout Add On";s:9:"PluginURI";s:66:"https://www.paidmembershipspro.com/add-ons/levels-page-div-layout/";s:4:"Slug";s:16:"pmpro-div-levels";s:6:"plugin";s:37:"pmpro-div-levels/pmpro-div-levels.php";s:7:"Version";s:2:".3";s:11:"Description";s:76:"Display your Membership Levels Page in a DIV Layout for Paid Memberships Pro";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:74:"https://license.paidmembershipspro.com/downloads/plus/pmpro-div-levels.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:20:"Levels as DIV Layout";}i:48;a:16:{s:4:"Name";s:9:"LifterLMS";s:5:"Title";s:9:"LifterLMS";s:9:"PluginURI";s:22:"https://lifterlms.com/";s:4:"Slug";s:9:"lifterlms";s:6:"plugin";s:23:"lifterlms/lifterlms.php";s:7:"Version";s:5:"7.3.0";s:11:"Description";s:107:"Complete e-learning platform to sell online courses, protect lessons, offer memberships, and quiz students.";s:12:"Installation";s:2027:"<p>Installation</p><h4>Minimum System Requirements</h4>\n<p>LifterLMS Requires</p>\n<ul>\n<li>PHP 7.4 or later</li>\n<li>WordPress 5.6 or later</li>\n<li>MySQL 5.6 or later</li>\n</ul>\n<p>Visit our <a href="https://lifterlms.com/docs/minimum-system-requirements-lifterlms/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">full system requirements</a> for additional information.</p>\n<h4>Automatic Installation</h4>\n<p>The simplest way to install LifterLMS is through your existing WordPress site’s admin. Let WordPress handle file transfers for you - you’ll never need to leave the web browser or admin panel.</p>\n<ol>\n<li>Log in to your WordPress dashboard</li>\n<li>Navigate to Plugins -&gt; Add New</li>\n<li>In the search field, type "LifterLMS" and click "Search Plugins"</li>\n<li>Once you\'ve located LifterLMS, click "Install Now"</li>\n<li>Once installation is complete, click "Activate"</li>\n</ol>\n<h4>Manual Installation</h4>\n<p>To manually install LifterLMS, you\'ll need to download the zip file using the "Download" link on this screen. Then, use FTP to manually upload the unzipped plugin folder to the proper plugins directory on your webserver.</p>\n<p>Please see this <a href="https://wordpress.org/documentation/article/manage-plugins/#manual-plugin-installation-1">WordPress Codex document</a> for full instructions on Manual Plugin Installation.</p>\n<h4>Setup Wizard</h4>\n<p>After installation, LifterLMS launches a friendly (and super quick) Setup Wizard.</p>\n<p>This wizard helps you configure LifterLMS so you can get to the fun stuff - like creating your courses - as quickly as possible.</p>\n<p>The wizard includes a few sample courses you can import if you want to see some examples before you start creating your own content.</p>\n<p>You can return to the setup wizard at any time by following <a href="https://lifterlms.com/docs/rerun-lifterlms-setup-wizard/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">these steps</a>.</p>";s:3:"FAQ";s:6287:"<p>Frequently Asked Questions</p><h4>Where do I buy add-ons or bundles for my LifterLMS eLearning Website?</h4>\n<p>You can explore the individual learning management system add-ons <a href="https://lifterlms.com/store/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">here</a> or save BIG with a <a href="https://lifterlms.com/product-category/bundles/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">bundle</a></p>\n<h4>How do I troubleshoot issues with my LMS website?</h4>\n<p>First, make sure that you\'re running the latest version of LifterLMS. And if you\'ve got any other LifterLMS plugins active on your site, make sure those are running the most current version as well.</p>\n<p>The most common issues we see are either plugin conflicts, theme conflicts, or outdated servers. You can test if a plugin or theme is conflicting by manually deactivating other plugins until just LifterLMS is running on your site. If the issue persists from there, revert to the default Twenty Fifteen theme. If the issue is resolved after deactivating a specific plugin or your theme, you\'ll know that is the source of the conflict. If it is a hosting issue, contact your web host and make sure they’re running the most current version of PHP.</p>\n<p>Also be sure to check out the official LifterLMS <a href="https://lifterlms.com/docs/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">Knowledge Base</a>.</p>\n<h4>How do I ask a question about my online course website?</h4>\n<p>Users of the free LifterLMS should post their questions here in our WordPress.org support area. If you find you\'re not getting support in as timely a fashion as you wish, you might want to consider <a href="https://lifterlms.com/pricing/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">purchasing a product from LifterLMS</a> so you can access the LifterLMS support team.</p>\n<p>If you\'re already a LifterLMS customer, you can simply log into your account and contact the support team directly on the <a href="https://lifterlms.com/my-account/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">LifterLMS website</a>. We can provide a deeper level of support in there and address your needs on a daily basis during the work week. Generally, except in times of increased support loads, we reply to all comments within 12 business hours.</p>\n<h4>LifterLMS is awesome! Can you set up my online course site for me?</h4>\n<p>LifterLMS offers technical support, but we do not offer custom website development services. However, we do recommend third party LifterLMS Experts who can help with web design, web development, instructional design or marketing for a fee.  Click here to visit the <a href="https://lifterlms.com/experts/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">LifterLMS Experts page</a>.</p>\n<h4>I\'m interested in purchasing add-ons for my WordPress LMS website, but I have a few questions first.</h4>\n<p>If you\'re not finding your questions answered here or on our website, you can ask your presales questions through this <a href="https://lifterlms.com/contact/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">contact form</a>. You can also connect live with a member of our team <a href="https://lifterlms.com/contact/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">here</a>.</p>\n<h4>What add-ons are available for LifterLMS, and where can I read more about them?</h4>\n<p>You can find a full list of official LifterLMS Add-ons <a href="https://lifterlms.com/store/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">here</a></p>\n<h4>I have a feature idea. What\'s the best way to tell you about it?</h4>\n<p>We care about your feature ideas and what you have to say. You can <a href="https://lifterlms.com/contact/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">request a feature</a>, <a href="?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">vote on existing feature requests</a>, and checkout the <a href="https://lifterlms.com/roadmap/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">product roadmap</a>.</p>\n<h4>Do you have any training for building an online course website?</h4>\n<p>Be sure you’ve taken the free tutorial training video course: <a href="https://academy.lifterlms.com/course/how-to-build-a-learning-management-system-with-lifterlms/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">How to Create an Online Course with LifterLMS</a>. We also encourage you to get to know us by signing up for a $1 temporary <em>30 Day</em> website on our servers which comes with the core LifterLMS plugin all our add-ons intalled. This demo allows you to test drive all the add-ons before you invest. Check it out here: <strong><a href="https://lifterlms.com/try/?utm_source=LifterLMS%20Plugin&amp;utm_medium=README&amp;utm_campaign=Readme%20to%20Sale">Try LifterLMS for $1</a></strong>.</p>\n<h4>I\'m interested in contributing to LifterLMS, how can I start?</h4>\n<p>LifterLMS is an open source project. We manage our team, developers, issues, and code on <a href="https://github.com/gocodebox/lifterlms/">GitHub</a>.</p>\n<p>We welcome contributions of all kinds, anyone can contribute even if you don\'t write code! Check out our <a href="https://github.com/gocodebox/lifterlms/blob/master/.github/CONTRIBUTING.md">Contributor\'s Guidelines</a> to get started.</p>\n<h4>I found a security vulnerability or issue, how can I report it to the team?</h4>\n<p>The LifterLMS team takes security issues and vulnerabilities very seriously. We appreciate your efforts to responsibly disclose your findings, and will make every effort to acknowledge your contributions.</p>\n<p>Please contact team@lifterlms.com to report a security vulnerability.</p>\n<p>You can review our full security policy at <a href="https://lifterlms.com/security-policy">https://lifterlms.com/security-policy</a>.</p>";s:9:"Changelog";s:3759:"<h4>Changelog</h4><p>v7.3.0 - 2023-08-08</p><h5>Updates and Enhancements</h5>\n<ul>\n<li>When a notice is shown for an access plan on the course edit screen (e.g. When using the WooCommerce integration and no product has been associated to the access plan.) Also display a warning icon next to the access plan title.</li>\n<li>Made sure only who can <code>view_others_lifterlms_reports</code> will be able to see the analytics widget content in the WordPress admin.</li>\n<li>Better rounding of float values on some reporting screens.</li>\n<li>Avoid creating a post revision when cloning a course/lesson.</li>\n<li>When creating pages via <code>llms_create_pages()</code>: strip all tags from the page title and slash the page data prior to inserting the page in the db via <code>wp_insert_post()</code> to prevent slashes from being stripped from the page title.</li>\n<li>Updated the WordPress tested version up to 6.3.</li>\n<li>Improved compatibility with the Divi theme by fixing an issue with the quiz attempt result clarifications not being visible when the Divi option <code>Defer jQuery And jQuery Migrate</code> was enabled. <a href="https://github.com/gocodebox/lifterlms/issues/2470">#2470</a></li>\n</ul>\n<h5>Bug Fixes</h5>\n<ul>\n<li>Fix spacer block when creating new certificate templates in WP 6.3.</li>\n<li>Fixed PHP Warning when no course/membership catalog page was set or if the selected page doesn\'t exist anymore. <a href="https://github.com/gocodebox/lifterlms/issues/2496">#2496</a></li>\n<li>Don\'t include WordPress default sidebar.php template when using a block theme. <a href="https://github.com/gocodebox/lifterlms/issues/2488">#2488</a></li>\n<li>Updated Kazakhstani Tenge\'s currency symbol. <a href="https://github.com/gocodebox/lifterlms/issues/2475">#2475</a></li>\n<li>Make the dashboard widget visible only if the current user has LMS Manager capabilities. <a href="https://github.com/gocodebox/lifterlms/issues/2500">#2500</a></li>\n<li>Fixed issue with LifterLMS Navigation Link block and block visibility settings. <a href="https://github.com/gocodebox/lifterlms/issues/2474">#2474</a></li>\n<li>Use student dashboard as default value for navigation link block. <a href="https://github.com/gocodebox/lifterlms/issues/2465">#2465</a></li>\n<li>Fixed typo in a function name that could potentially produce a fatal. Thanks <a href="https://github.com/kamalahmed">@kamalahmed</a>!</li>\n</ul>\n<h5>Developer Notes</h5>\n<ul>\n<li>Added the parameter <code>$tab</code> (ID/slug of the tab) to the <code>lifterlms_reporting_tab_cap</code> filter hook. Thanks <a href="https://github.com/sapayth">@sapayth</a>! <a href="https://github.com/gocodebox/lifterlms/issues/2468">#2468</a></li>\n<li>Added new filter hook <code>llms_can_analytics_widget_be_processed</code> that will allow to filter wheteher or not an analytics widgegt can be processed/disoplayed.</li>\n<li>Added new filter <code>llms_install_get_pages</code>.</li>\n<li>Added new public static method <code>LLMS_Admin_Dashboard_Widget::get_dashboard_widget_data()</code>.</li>\n<li>Added <code>llms_dashboard_checklist</code> and <code>llms_dashboard_widget_data</code> filters to adjust dashboard content. <a href="https://github.com/gocodebox/lifterlms/issues/2491">#2491</a></li>\n</ul>\n<h5>Updated Templates</h5>\n<ul>\n<li><a href="https://github.com/gocodebox/lifterlms/blob/7.3.0/templates/admin/reporting/tabs/widgets.php">templates/admin/reporting/tabs/widgets.php</a></li>\n<li><a href="https://github.com/gocodebox/lifterlms/blob/7.3.0/templates/global/sidebar.php">templates/global/sidebar.php</a></li>\n<li><a href="https://github.com/gocodebox/lifterlms/blob/7.3.0/templates/quiz/results-attempt-questions-list.php">templates/quiz/results-attempt-questions-list.php</a></li>\n</ul>";s:6:"Author";s:9:"LifterLMS";s:9:"AuthorURI";s:22:"https://lifterlms.com/";s:8:"Download";s:52:"https://downloads.wordpress.org/plugin/lifterlms.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:9:"LifterLMS";}i:49;a:16:{s:4:"Name";s:46:"Paid Memberships Pro - Limit Post Views Add On";s:5:"Title";s:46:"Paid Memberships Pro - Limit Post Views Add On";s:9:"PluginURI";s:66:"https://www.paidmembershipspro.com/add-ons/pmpro-limit-post-views/";s:4:"Slug";s:22:"pmpro-limit-post-views";s:6:"plugin";s:49:"pmpro-limit-post-views/pmpro-limit-post-views.php";s:7:"Version";s:3:"1.0";s:11:"Description";s:115:"Integrates with Paid Memberships Pro to limit the number of times members and visitors can view posts on your site.";s:12:"Installation";s:501:"<p>Installation</p><ol>\n<li>Make sure you have the Paid Memberships Pro plugin installed and activated.</li>\n<li>Upload the <code>pmpro-limit-post-views</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Configure settings on the Limit Post Views settings page.</li>\n<li>Make sure your PMPro levels page mentions the post viewing limit so users know why they are being redirected.</li>\n</ol>";s:3:"FAQ";s:513:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-limit-post-views/issues">https://github.com/strangerstudios/pmpro-limit-post-views/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:1019:"<h4>Changelog</h4><p>1.0 - 2024-06-06</p><ul>\n<li>FEATURE: Custom JavaScript can now be run when LPV is granting access to restricted content using the <code>pmprolpv_allow_view_js</code> filter.</li>\n<li>FEATURE: Custom JavaScript can now be run when LPV is denying access to content using the <code>pmprolpv_deny_view_js</code> filter.</li>\n<li>ENHANCEMENT: Overhauled the view tracking cookie data structure for simplicity and to allow for future enhancements.</li>\n<li>BUG FIX/ENHANCEMENT: Added support for Multiple Memberships Per User.</li>\n<li>BUG FIX/ENHANCEMENT: View tracking and content restriction are now performed using an AJAX call to avoid caching issues.</li>\n<li>REFACTOR: Organized plugin code into separate files.</li>\n<li>DEPRECATED: Removed the option to redirect from restricted content with PHP.</li>\n<li>DEPRECATED: No longer tracking views per level. If the user has multiple levels, LPV will track views until the total number of views surpasses the limit for all of their levels.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:79:"http://license.paidmembershipspro.com/downloads/plus/pmpro-limit-post-views.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:16:"Limit Post Views";}i:50;a:16:{s:4:"Name";s:36:"Paid Memberships Pro - Local Pricing";s:5:"Title";s:36:"Paid Memberships Pro - Local Pricing";s:9:"PluginURI";s:57:"https://www.paidmembershipspro.com/add-ons/local-pricing/";s:4:"Slug";s:19:"pmpro-local-pricing";s:6:"plugin";s:43:"pmpro-local-pricing/pmpro-local-pricing.php";s:7:"Version";s:3:"1.0";s:11:"Description";s:151:"Dynamically convert level pricing at checkout to the approximate rate in the visitor\'s local currency, as detected by their IP address and geolocation.";s:12:"Installation";s:971:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-local-pricing</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to Memberships &gt; Settings &gt; Payment Gateway.</li>\n<li>Enter your App ID and save settings.</li>\n</ol>\n<p>Note: currency conversions are processed using the <a href="https://openexchangerates.org/">https://openexchangerates.org/</a> API. If your site\'s default currency is USD, you can use an API key linked to a free account at <a href="https://openexchangerates.org/">https://openexchangerates.org/</a>. All other currencies will require a paid plan with the API provider.</p>\n<p>Refer to the <a href="https://www.paidmembershipspro.com/add-ons/local-pricing/">Local Pricing Add On documentation page</a> for more information on how to set up this Add On or for a code recipe to offer unique discount codes based on location.</p>";s:3:"FAQ";s:33:"<p>Frequently Asked Questions</p>";s:9:"Changelog";s:76:"<h4>Changelog</h4><p>1.0 - 2024-08-07</p><ul>\n<li>Initial release</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:80:"http://license.paidmembershipspro.com/downloads/standard/pmpro-local-pricing.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:13:"Local Pricing";}i:51;a:16:{s:4:"Name";s:44:"Paid Memberships Pro - Lock Membership Level";s:5:"Title";s:44:"Paid Memberships Pro - Lock Membership Level";s:9:"PluginURI";s:71:"https://www.paidmembershipspro.com/add-ons/pmpro-lock-membership-level/";s:4:"Slug";s:27:"pmpro-lock-membership-level";s:6:"plugin";s:59:"pmpro-lock-membership-level/pmpro-lock-membership-level.php";s:7:"Version";s:5:"1.0.1";s:11:"Description";s:61:"Lock membership level changes for specific users or by level.";s:12:"Installation";s:611:"<p>Installation</p><ol>\n<li>Make sure you have Paid Memberships Pro installed and activated.</li>\n<li>Upload the <code>pmpro-lock-membership-level</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Add a new page for the "Membership Locked" message and assign it under Memberships &gt; Page settings. This is the page that members will be redirected to when attempting to cancel or change membership.</li>\n<li>Add the shortcode [pmpro_membership_locked] to that page. The shortcode\'s only attribute "message" can be used to customize the default message shown.</li>\n</ol>";s:3:"FAQ";s:525:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-lock-membership-level/issues">https://github.com/strangerstudios/pmpro-lock-membership-level/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:490:"<h4>Changelog</h4><p>1.0.1 - 2024-02-27</p><ul>\n<li>BUG FIX: Fixed PHP error when trying to delete a lock for a user when using PMPro v2.x. #30 (@dparker1005)</li>\n<li>BUG FIX: Fixed issue where the lock expiration would show as "Jan 1, 1970" instead of "Never" while editing a user when using PMPro v2.x. #30 (@dparker1005)</li>\n<li>BUG FIX: Fixed conflict with the PMPro Unlock Protocol Add On where this plugin\'s Edit Member panel may not show. #30 (@dparker1005, @kimcoleman)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:88:"http://license.paidmembershipspro.com/downloads/standard/pmpro-lock-membership-level.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:21:"Lock Membership Level";}i:52;a:16:{s:4:"Name";s:39:"Paid Memberships Pro - Mailchimp Add On";s:5:"Title";s:39:"Paid Memberships Pro - Mailchimp Add On";s:9:"PluginURI";s:71:"https://www.paidmembershipspro.com/add-ons/pmpro-mailchimp-integration/";s:4:"Slug";s:15:"pmpro-mailchimp";s:6:"plugin";s:35:"pmpro-mailchimp/pmpro-mailchimp.php";s:7:"Version";s:5:"2.3.6";s:11:"Description";s:63:"Sync your WordPress users and members with Mailchimp audiences.";s:12:"Installation";s:1523:"<p>Installation</p><p>This plugin works with and without Paid Memberships Pro installed.</p><p>Download, Install and Activate!</p><ol>\n<li>Upload the <code>pmpro-mailchimp</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to Settings &gt; PMPro Mailchimp to proceed with setup.</li>\n</ol><p>Configuration and Settings</p><p><strong>Enter your Mailchimp API Key:</strong> Your Mailchimp API key can be found within your Mailchimp account under Account &gt; Extras &gt; API keys. If you don\'t have a Mailchimp account, <a href="http://eepurl.com/k4aAH">you can create one here</a>. Read our documentation for a <a href="https://www.paidmembershipspro.com/add-ons/pmpro-mailchimp-integration/#api-key">video demonstrating how to locate your Mailchimp API key</a>.</p>\n<p>After entering your API Key, continue with the setup by assigning User or Member Audiences and reviewing the additional settings.</p>\n<p>For full documentation on all settings, please visit the <a href="https://www.paidmembershipspro.com/add-ons/pmpro-mailchimp-integration/">Mailchimp Integration Add On documentation page at Paid Memberships Pro</a>. </p>\n<p>Several action and filter hooks are available for developers that need to customize specific aspects of the integration. <a href="https://www.paidmembershipspro.com/add-ons/pmpro-mailchimp-integration/#hooks">Please explore the plugin\'s action and filter hooks here</a>.</p>";s:3:"FAQ";s:547:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-mailchimp/issues">https://github.com/strangerstudios/pmpro-mailchimp/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit <a href="http://www.paidmembershipspro.com/">our support site at https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:217:"<h4>Changelog</h4><p>2.3.6 - 2024-03-27</p><ul>\n<li>SECURITY: Now preparing SQL statements.</li>\n<li>SECURITY: Improved escaping of strings.</li>\n<li>ENHANCEMENT: Added translator comments for placeholders.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:58:"https://downloads.wordpress.org/plugin/pmpro-mailchimp.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:9:"Mailchimp";}i:53;a:16:{s:4:"Name";s:31:"Paid Memberships Pro - MailPoet";s:5:"Title";s:31:"Paid Memberships Pro - MailPoet";s:9:"PluginURI";s:64:"https://www.paidmembershipspro.com/add-ons/mailpoet-integration/";s:4:"Slug";s:36:"mailpoet-paid-memberships-pro-add-on";s:6:"plugin";s:77:"mailpoet-paid-memberships-pro-add-on/mailpoet-paid-memberships-pro-add-on.php";s:7:"Version";s:5:"3.2.1";s:11:"Description";s:107:"Automatically subscribe members to MailPoet lists or allow them to opt-in to specific MailPoet newsletters.";s:12:"Installation";s:2430:"<p>Installation</p><p>Note: You must have <a href="https://wordpress.org/plugins/paid-memberships-pro/">Paid Memberships Pro</a> installed and activated on your site.</p>\n<h3>Install PMPro MailPoet from within WordPress</h3>\n<ol>\n<li>Visit the plugins page within your dashboard and select "Add New"</li>\n<li>Search for "PMPro MailPoet"</li>\n<li>Locate this plugin and click "Install"</li>\n<li>Activate "Paid Memberships Pro - MailPoet Add On" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>Install PMPro MailPoet Manually</h3>\n<ol>\n<li>Upload the <code>MailPoet-Paid-Memberships-Pro-Add-on</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate "Paid Memberships Pro - MailPoet Integration" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>After Activation: Configure Membership Settings for MailPoet</h3>\n<p>Below is a description of the various settings available in the plugin. Navigate to Memberships &gt; MailPoet in the WordPress admin to configure the plugin for your site</p>\n<ul>\n<li>Non-Members List: Users are automatically subscribed to non-member lists when they register without a membership level or when their membership level is removed.</li>\n<li>Opt-In List: Give users the option to subscribe to additional lists at checkout and on their profile page.</li>\n<li>Membership Lists: Assign MailPoet subscriptions to each membership. Members are automatically subscribed to these lists during checkout or after membership level changes. You can add members to a single list or multiple lists depending on your needs.</li>\n<li>Unsubscribe On Level Change? Choose whether subscribers should be removed from their level lists when their membership changes. This setting unsubscribes members from their current level’s list when they cancel, expire, or otherwise change their membership level.</li>\n</ul>\n<h3>Import Current Members to MailPoet</h3>\n<p>This integration plugin does not perform a retroactive update of all membership levels &gt; subscriber list settings. If you want to start using MailPoet and you already have members, you must complete a one-time import to sync MailPoet subscribers and members.</p>\n<p><a href="https://www.paidmembershipspro.com/import-members-to-mailpoet-lists/">View the Guide: How to Import Your PMPro Members List to MailPoet Subscriber Lists »</a></p>";s:3:"FAQ";s:589:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/MailPoet-Paid-Memberships-Pro-Add-on/issues">https://github.com/strangerstudios/MailPoet-Paid-Memberships-Pro-Add-on/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit <a href="http://www.paidmembershipspro.com/">our support site at https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:195:"<h4>Changelog</h4><p>3.2.1 - 2024-07-25</p><ul>\n<li>BUG FIX: Fixed issue where the Edit Member page would not show any panels if there are no opt-in lists configured. #17 (@JarrydLong)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:79:"https://downloads.wordpress.org/plugin/mailpoet-paid-memberships-pro-add-on.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:8:"MailPoet";}i:54;a:16:{s:4:"Name";s:43:"Paid Memberships Pro - Member Badges Add On";s:5:"Title";s:43:"Paid Memberships Pro - Member Badges Add On";s:9:"PluginURI";s:57:"https://www.paidmembershipspro.com/add-ons/member-badges/";s:4:"Slug";s:19:"pmpro-member-badges";s:6:"plugin";s:43:"pmpro-member-badges/pmpro-member-badges.php";s:7:"Version";s:3:"1.0";s:11:"Description";s:115:"Assign unique member badges (images) to each membership level and display via a shortcode or template PHP function.";s:12:"Installation";s:549:"<h4>Installation</h4><p>Installation</p><p>This plugin works with and without Paid Memberships Pro installed.</p><p>Download, Install and Activate!</p><ol>\n<li>Upload the <code>pmpro-member-badges</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Edit your membership levels to upload badges images.</li>\n<li>Use the [pmpro_member_badge] shortcode or the <code>pmpromb_show_badge()</code> function to show a badge on your site.</li>\n</ol>";s:3:"FAQ";s:596:"<h4>Frequently Asked Questions</h4><p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-member-badges/issues">https://github.com/strangerstudios/pmpro-member-badges/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:291:"<h4>Changelog</h4><p>1.0 - 2020-05-08</p><ul>\n<li>ENHANCEMENT: Added support for multiple memberships per user.</li>\n<li>ENHANCEMENT: Modernized the default badge images included in the plugin.</li>\n<li>ENHANCEMENT: Improved image uploader to use newer uploader for member badges.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:77:"https://license.paidmembershipspro.com/downloads/plus/pmpro-member-badges.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:13:"Member Badges";}i:55;a:16:{s:4:"Name";s:46:"Paid Memberships Pro - Member Directory Add On";s:5:"Title";s:46:"Paid Memberships Pro - Member Directory Add On";s:9:"PluginURI";s:60:"https://www.paidmembershipspro.com/add-ons/member-directory/";s:4:"Slug";s:22:"pmpro-member-directory";s:6:"plugin";s:49:"pmpro-member-directory/pmpro-member-directory.php";s:7:"Version";s:5:"1.2.6";s:11:"Description";s:81:"Adds a customizable Member Directory and Member Profiles to your membership site.";s:12:"Installation";s:652:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-member-directory</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the <code>Plugins</code> menu in WordPress.</li>\n<li>Create a page for your directory and set the appropriate shortcode attributes and <code>Require Membership</code> settings per your needs.</li>\n<li>Create a page for your profile and set the appropriate shortcode attributes and <code>Require Membership</code> settings per your needs.</li>\n<li>Navigate to Memberships &gt; Page Settings to assign your pages to the Directory and Profile page settings.</li>\n</ol>";s:3:"FAQ";s:567:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-member-directory/issues">https://github.com/strangerstudios/pmpro-member-directory/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:144:"<h4>Changelog</h4><p>1.2.6 - 2024-02-19</p><ul>\n<li>SECURITY: Improved security around shortcode attributes to prevent SQL injection.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:35:"https://www.paidmembershipspro.com/";s:8:"Download";s:79:"http://license.paidmembershipspro.com/downloads/plus/pmpro-member-directory.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:16:"Member Directory";}i:56;a:16:{s:4:"Name";s:44:"Paid Memberships Pro - Member History Add On";s:5:"Title";s:44:"Paid Memberships Pro - Member History Add On";s:9:"PluginURI";s:64:"https://www.paidmembershipspro.com/add-ons/pmpro-member-history/";s:4:"Slug";s:20:"pmpro-member-history";s:6:"plugin";s:45:"pmpro-member-history/pmpro-member-history.php";s:7:"Version";s:4:".3.1";s:11:"Description";s:77:"Display a history of a user\'s Membership on the User Profile for admins only.";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:78:"https://license.paidmembershipspro.com/downloads/plus/pmpro-member-history.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:14:"Member History";}i:57;a:16:{s:4:"Name";s:46:"Paid Memberships Pro - Member Homepages Add On";s:5:"Title";s:46:"Paid Memberships Pro - Member Homepages Add On";s:9:"PluginURI";s:60:"https://www.paidmembershipspro.com/add-ons/member-homepages/";s:4:"Slug";s:22:"pmpro-member-homepages";s:6:"plugin";s:49:"pmpro-member-homepages/pmpro-member-homepages.php";s:7:"Version";s:5:"0.3.1";s:11:"Description";s:75:"Redirect members to a unique homepage or landing page based on their level.";s:12:"Installation";s:358:"<p>Installation</p><p>Download, Install and Activate!</p><ol>\n<li>Upload the <code>pmpro-member-homepages</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Edit your membership levels to assign a level\'s homepage and configure settings.</li>\n</ol>";s:3:"FAQ";s:569:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-member-homepages/issues">https://github.com/strangerstudios/pmpro-member-homepages/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:567:"<h4>Changelog</h4><p>0.3.1 - 2023-10-12</p><ul>\n<li>ENHANCEMENT: Adding filter <code>pmpromh_prioritized_levels</code> for compatibility with Multiple Memberships Per User. #27 (@dparker1005)</li>\n<li>BUG FIX/ENHANCEMENT: Added compatibility with Elementor when trying to edit a static homepage. #30 (@andrewlimaza)</li>\n<li>BUG FIX: Fixed issue where users would not be redirected to their member homepages on login if the “ignore redirect to” setting is disabled and the <code>$redirect_to</code> variable is not set for the login. #26 (@dparker1005)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:79:"http://license.paidmembershipspro.com/downloads/plus/pmpro-member-homepages.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:16:"Member Homepages";}i:58;a:16:{s:4:"Name";s:50:"Paid Memberships Pro - Member Network Sites Add On";s:5:"Title";s:50:"Paid Memberships Pro - Member Network Sites Add On";s:9:"PluginURI";s:78:"https://www.paidmembershipspro.com/add-ons/pmpro-network-multisite-membership/";s:4:"Slug";s:13:"pmpro-network";s:6:"plugin";s:31:"pmpro-network/pmpro-network.php";s:7:"Version";s:5:"0.5.4";s:11:"Description";s:76:"Create a network site for the member as part of membership to the main site.";s:12:"Installation";s:429:"<p>Installation</p><ol>\n<li>Make sure you have the Paid Memberships Pro plugin installed and activated.</li>\n<li>Make sure you have properly configured Network Sites on your WordPress Multisite.</li>\n<li>Upload the \'pmpro-network\' directory to the \'/wp-content/plugins/\' directory of your site.</li>\n<li>Activate the plugin on the main site (the primary domaoin of the network) through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:497:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-network/issues">https://github.com/strangerstudios/pmpro-network/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:144:"<h4>Changelog</h4><p>0.5.4 - 2024-02-06</p><ul>\n<li>SECURITY: Improved security to the frontend shortcode to create and manage sites.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:70:"http://license.paidmembershipspro.com/downloads/plus/pmpro-network.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:20:"Member Network Sites";}i:59;a:16:{s:4:"Name";s:40:"Paid Memberships Pro - Member RSS Add On";s:5:"Title";s:40:"Paid Memberships Pro - Member RSS Add On";s:9:"PluginURI";s:54:"http://www.paidmembershipspro.com/wp/pmpro-member-rss/";s:4:"Slug";s:16:"pmpro-member-rss";s:6:"plugin";s:37:"pmpro-member-rss/pmpro-member-rss.php";s:7:"Version";s:3:"0.3";s:11:"Description";s:57:"Create Member-Specific RSS Feeds for Paid Memberships Pro";s:12:"Installation";s:224:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-member-rss</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:555:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-member-rss/issues">https://github.com/strangerstudios/pmpro-member-rss/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:703:"<h4>Changelog</h4><p>0.3 - 2022-10-21</p>\n<ul>\n<li>FEATURE: You can now regenerate a user\'s RSS key from the edit user page of the WP dashboard.</li>\n<li>BUG FIX/ENHANCEMENT: Now using the pmpro_has_membership_access() function to account for all methods of protecting content.</li>\n<li>BUG FIX/ENHANCEMENT: Now also generating a member RSS key (if needed) on level change in case that happens outside of checkout.</li>\n<li>BUG FIX/ENHANCEMENT: Updating search queries so protected content is still visible in feeds when a member RSS key is used. </li>\n</ul>\n<p>= .2.</p><ul>\n<li>Now removing enclosures from member posts.</li>\n<li>Filtering the RSS content filter to show a link to the post.</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:30:"http://www.strangerstudios.com";s:8:"Download";s:73:"http://license.paidmembershipspro.com/downloads/plus/pmpro-member-rss.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:10:"Member RSS";}i:60;a:16:{s:4:"Name";s:19:"Memberlite Elements";s:5:"Title";s:19:"Memberlite Elements";s:9:"PluginURI";s:52:"https://www.memberlitetheme.com/memberlite-elements/";s:4:"Slug";s:19:"memberlite-elements";s:6:"plugin";s:43:"memberlite-elements/memberlite-elements.php";s:7:"Version";s:3:"1.1";s:11:"Description";s:86:"A set of elements designed enhance the appearance of sites using the Memberlite Theme.";s:12:"Installation";s:679:"<p>Installation</p><p>Download, Install and Activate</p><p>In your WordPress admin, go to Plugins &gt; Add New to install Memberlite Shortcodes, or:</p>\n<ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /memberlite-elements/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>Start Using the Elements!</p><p>Browse the Memberlite Elements documentation to see all features, their attributes, and to view sample demos.</p>\n<p><a href="https://memberlitetheme.com/memberlite-elements/">View Documentation</a></p>";s:3:"FAQ";s:650:"<p>Frequently Asked Questions</p><p>Where can I find Memberlite Elements documentation and user guides?</p><p>For help setting up and configuring the Memberlite Elements plugin, please refer to <a href="https://memberlitetheme.com/memberlite-elements/">documentation</a>.</p><p>Where can I get the Memberlite Theme?</p><p>Visit <a href="https://memberlitetheme.com">https://memberlitetheme.com</a> to get your copy of the Memberlite Theme.</p><p>I\'m not using the Memberlite Theme - can I still use Memberlite Elements plugin?</p><p>As of this release, Memberlite Elements is only compatible with the Memberlite Theme or a Memberlite Child Theme.</p>";s:9:"Changelog";s:202:"<h4>Changelog</h4><p>1.1.0 - 2023-09-21</p><ul>\n<li>SECURITY: Improved sanitization and escaping of elements.</li>\n<li>REFACTOR: Improved accessibility for screen readers and plugin settings.</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:31:"https://www.memberlitetheme.com";s:8:"Download";s:62:"https://downloads.wordpress.org/plugin/memberlite-elements.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:19:"Memberlite Elements";}i:61;a:16:{s:4:"Name";s:21:"Memberlite Shortcodes";s:5:"Title";s:21:"Memberlite Shortcodes";s:9:"PluginURI";s:50:"https://memberlitetheme.com/memberlite-shortcodes/";s:4:"Slug";s:21:"memberlite-shortcodes";s:6:"plugin";s:47:"memberlite-shortcodes/memberlite-shortcodes.php";s:7:"Version";s:5:"1.3.9";s:11:"Description";s:82:"Shortcodes designed to work with the Memberlite Theme and Memberlite Child Themes.";s:12:"Installation";s:699:"<p>Installation</p><p>Download, Install and Activate</p><p>In your WordPress admin, go to Plugins &gt; Add New to install Memberlite Shortcodes, or:</p>\n<ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /memberlite-shortcodes/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>Start Using the Shortcodes!</p><p>Browse the Memberlite Shortcodes documentation to see all shortcodes, their attributes, and to view sample shortcode demos.</p>\n<p><a href="https://memberlitetheme.com/memberlite-shortcodes/">View Documentation</a></p>";s:3:"FAQ";s:681:"<p>Frequently Asked Questions</p><p>Where can I find Memberlite Shortcodes documentation and user guides?</p><p>For help setting up and configuring the Memberlite Shortcodes plugin, please refer to <a href="https://memberlitetheme.com/memberlite-shortcodes/">documentation</a>.</p><p>Where can I get the Memberlite Theme?</p><p>Visit <a href="https://memberlitetheme.com">https://memberlitetheme.com</a> to get your copy of the Memberlite Theme.</p><p>I\'m not using the Memberlite Theme - can I still use Memberlite Shortcodes plugin?</p><p>Some of the shortcodes in this plugin will work with any theme, but we cannot guarantee the appearance will match that of the demo site.</p>";s:9:"Changelog";s:215:"<h4>Changelog</h4><p>1.3.9 - 2023-09-21</p><ul>\n<li>SECURITY: Sanitized and Escaped shortcode attributes and variables.</li>\n<li>REFACTOR: Improved accessibility for screen readers for certain shortcodes.</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:27:"https://memberlitetheme.com";s:8:"Download";s:64:"https://downloads.wordpress.org/plugin/memberlite-shortcodes.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:21:"Memberlite Shortcodes";}i:62;a:16:{s:4:"Name";s:45:"Paid Memberships Pro - Membership Card Add On";s:5:"Title";s:45:"Paid Memberships Pro - Membership Card Add On";s:9:"PluginURI";s:59:"http://www.paidmembershipspro.com/wp/pmpro-membership-card/";s:4:"Slug";s:21:"pmpro-membership-card";s:6:"plugin";s:47:"pmpro-membership-card/pmpro-membership-card.php";s:7:"Version";s:5:"1.1.3";s:11:"Description";s:81:"Display a printable Membership Card for Paid Memberships Pro members or WP users.";s:12:"Installation";s:736:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-membership-card</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Create a page and add the [pmpro_membership_card] shortcode to it.</li>\n<li>(Optional) The page\'s "featured image" will be added to the membership card.</li>\n<li>(Optional) Specify the shortcode attribute \'print_size\'. Options include: small, medium, large or all. Default is: all. (ex: [pmpro_membership_card print_size="small,medium"])</li>\n<li>(Optional) Copy the pmpro-membership-card/templates/membership-card.php file to your active theme\'s directory and edit it to change the card template.</li>\n</ol>";s:3:"FAQ";s:319:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-membership-card/issues">https://github.com/strangerstudios/pmpro-membership-card/issues</a></p>";s:9:"Changelog";s:343:"<h4>Changelog</h4><p>1.1.3 - 2024-04-25</p><ul>\n<li>ENHANCEMENT: Improvements added to the print functionality and adjusted printing sizes.</li>\n<li>ENHANCEMENT: Adjusted title of the membership card from H3 to H2 to improve accessibility and screen readers.</li>\n<li>REFACTOR: Added comments to code for improved IDE compatibility.</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:30:"http://www.strangerstudios.com";s:8:"Download";s:82:"http://license.paidmembershipspro.com/downloads/standard/pmpro-membership-card.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:15:"Membership Card";}i:63;a:16:{s:4:"Name";s:53:"Paid Memberships Pro - Membership Manager Role Add On";s:5:"Title";s:53:"Paid Memberships Pro - Membership Manager Role Add On";s:9:"PluginURI";s:73:"https://www.paidmembershipspro.com/add-ons/pmpro-membership-manager-role/";s:4:"Slug";s:29:"pmpro-membership-manager-role";s:6:"plugin";s:63:"pmpro-membership-manager-role/pmpro-membership-manager-role.php";s:7:"Version";s:5:"0.3.3";s:11:"Description";s:86:"Adds a Membership Manager role to WordPress with access to PMPro settings and reports.";s:12:"Installation";s:237:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-membership-manager-role</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:311:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-gift-levels/issues">https://github.com/strangerstudios/pmpro-gift-levels/issues</a></p>";s:9:"Changelog";s:218:"<h4>Changelog</h4><p>0.3.3 - 2024-02-29</p><ul>\n<li>ENHANCEMENT: Improved capability support for Paid Memberships Pro 3.0+</li>\n<li>ENHANCEMENT: Added localization to the plugin to make strings translatable.</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:86:"http://license.paidmembershipspro.com/downloads/plus/pmpro-membership-manager-role.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:23:"Membership Manager Role";}i:64;a:16:{s:4:"Name";s:45:"Paid Memberships Pro - Membership Maps Add On";s:5:"Title";s:45:"Paid Memberships Pro - Membership Maps Add On";s:9:"PluginURI";s:59:"https://www.paidmembershipspro.com/add-ons/membership-maps/";s:4:"Slug";s:21:"pmpro-membership-maps";s:6:"plugin";s:47:"pmpro-membership-maps/pmpro-membership-maps.php";s:7:"Version";s:5:"0.7.1";s:11:"Description";s:58:"Display a map of members or for a single member\'s profile.";s:12:"Installation";s:894:"<p>Installation</p><p>Download, Install and Activate!</p><ol>\n<li>Upload the <code>pmpro-membership-maps</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>Settings</p><ol>\n<li>This plugin requires Paid Memberships Pro to be installed and activated.</li>\n<li>By default, the map will geocode the member’s "Billing Address". Navigate to Memberships &gt; Settings &gt; Payment Gateway &amp; SSL in the WordPress admin. Confirm the "Show Billing Address Fields" setting is set to "Yes".</li>\n<li>Next, enter your Google Maps API Key on the Memberships &gt; Settings &gt; Advanced Settings page in the WordPress admin. <a href="https://www.paidmembershipspro.com/add-ons/membership-maps/#google-maps-api-key">Click here for help obtaining up your Google Maps API Key</a>.</li>\n</ol>";s:3:"FAQ";s:567:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-membership-maps/issues">https://github.com/strangerstudios/pmpro-membership-maps/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:168:"<h4>Changelog</h4><p>0.7.1 - 2024-02-26</p><ul>\n<li>BUG FIX: Fixed a bug introduced in 0.7 where the map would not display markers due to undefined variable.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:78:"http://license.paidmembershipspro.com/downloads/plus/pmpro-membership-maps.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:15:"Membership Maps";}i:65;a:16:{s:4:"Name";s:54:"Paid Memberships Pro - Mobile Reports Dashboard Add On";s:5:"Title";s:54:"Paid Memberships Pro - Mobile Reports Dashboard Add On";s:9:"PluginURI";s:72:"https://www.paidmembershipspro.com/add-ons/responsive-reports-dashboard/";s:4:"Slug";s:23:"pmpro-reports-dashboard";s:6:"plugin";s:51:"pmpro-reports-dashboard/pmpro-reports-dashboard.php";s:7:"Version";s:3:"1.0";s:11:"Description";s:89:"Streamlined membership site reports dashboard designed for mobile and responsive screens.";s:12:"Installation";s:443:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-reports-dashboard</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to www.YOURDOMAIN.com/pmpro-reports-dashboard/ to load the dashboard.</li>\n<li>Optionally use your mobile device\'s "Add to Home Screen" feature to add the app to your device for instant access.</li>\n</ol>";s:3:"FAQ";s:323:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-reports-dashboard/issues">https://github.com/strangerstudios/pmpro-reports-dashboard/issues</a></p>";s:9:"Changelog";s:263:"<h4>Changelog</h4><p>1.0 - 2024-01-05</p><ul>\n<li>FEATURE: The mobile reports dashboard is now a PWA (Progressive Web App) and can be added to your mobile device\'s home screen for instant access.</li>\n<li>FEATURE: Overhauled design with faster updates.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:80:"http://license.paidmembershipspro.com/downloads/plus/pmpro-reports-dashboard.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:24:"Mobile Reports Dashboard";}i:66;a:16:{s:4:"Name";s:52:"Paid Memberships Pro - Multiple Memberships per User";s:5:"Title";s:52:"Paid Memberships Pro - Multiple Memberships per User";s:9:"PluginURI";s:70:"http://www.paidmembershipspro.com/pmpro-multiple-memberships-per-user/";s:4:"Slug";s:35:"pmpro-multiple-memberships-per-user";s:6:"plugin";s:75:"pmpro-multiple-memberships-per-user/pmpro-multiple-memberships-per-user.php";s:7:"Version";s:5:"0.8.4";s:11:"Description";s:91:"Update PMPro to allow users to checkout for and hold multiple memberships at the same time.";s:12:"Installation";s:227:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-multiple-memberships-per-user</code> folder to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:279:"<h4>Changelog</h4><p>0.8.4 - 2023-06-14</p><ul>\n<li>BUG FIX: Added additional check to prevent JavaScript from loading on pages other than the checkout page.</li>\n<li>REFACTOR: Added version to Checkout page template to avoid outdated template warnings in PMPro v2.11+</li>\n</ul>";s:6:"Author";s:37:"Square Lines LLC and Stranger Studios";s:9:"AuthorURI";s:27:"http://www.square-lines.com";s:8:"Download";s:92:"http://license.paidmembershipspro.com/downloads/plus/pmpro-multiple-memberships-per-user.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:29:"Multiple Memberships per User";}i:67;a:16:{s:4:"Name";s:68:"Paid Memberships Pro - Multiple Memberships per User (Legacy Plugin)";s:5:"Title";s:68:"Paid Memberships Pro - Multiple Memberships per User (Legacy Plugin)";s:9:"PluginURI";s:60:"http://www.paidmembershipspro.com/add-ons/pmpro-mmpu-legacy/";s:4:"Slug";s:17:"pmpro-mmpu-legacy";s:6:"plugin";s:39:"pmpro-mmpu-legacy/pmpro-mmpu-legacy.php";s:7:"Version";s:3:"0.1";s:11:"Description";s:60:"Preserve some aspects of the old MMPU add on for PMPro 3.0+.";s:12:"Installation";s:305:"<p>Installation</p><ol>\n<li>Make sure you have Paid Memberships Pro v3.0+ installed and activated.</li>\n<li>Upload the <code>pmpro-mmpu-legacy</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:505:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-mmpu-legacy/issues">https://github.com/strangerstudios/pmpro-mmpu-legacy/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:77:"<h4>Changelog</h4><p>0.1 - 2024-03-21</p><ul>\n<li>Initial version.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:74:"http://license.paidmembershipspro.com/downloads/plus/pmpro-mmpu-legacy.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:45:"Multiple Memberships per User (Legacy Plugin)";}i:68;a:16:{s:4:"Name";s:50:"Paid Memberships Pro - Multisite Membership Add On";s:5:"Title";s:50:"Paid Memberships Pro - Multisite Membership Add On";s:9:"PluginURI";s:68:"https://www.paidmembershipspro.com/add-ons/pmpro-network-membership/";s:4:"Slug";s:21:"pmpro-network-subsite";s:6:"plugin";s:47:"pmpro-network-subsite/pmpro-network-subsite.php";s:7:"Version";s:5:"0.5.2";s:11:"Description";s:139:"Manage memberships at the network’s main site (the primary domain of the network) and provide/restrict access on subsites in the network.";s:12:"Installation";s:1259:"<p>Installation</p><ol>\n<li>Install Paid Memberships Pro via Network Admin &gt; Plugins &gt; Add New. Do not "Network Activate" the plugin.</li>\n<li>On your main network site, activate and configure Paid Memberships Pro by following the Initial Plugin Setup guide.</li>\n<li>Upload the \'pmpro-network-subsite\' directory to the \'wp-content/plugins/\' directory of your WordPress Multisite environment.</li>\n<li>For each site in your network that has member content, navigate to the site\'s Dashboard &gt; Plugins. Activate Paid Memberships Pro AND the Multisite Membership Add On.</li>\n<li>DO NOT activate the \'pmpro-network-subsite\' plugin on the “Main” site (i.e. where people checkout) of your network.</li>\n<li>Make sure that the constant PMPRO_NETWORK_MAIN_DB_PREFIX is properly defined for your main network site in your wp-config.php file. For example: define(\'PMPRO_NETWORK_MAIN_DB_PREFIX\', \'wp\');</li>\n</ol>\n<p>You will now be able to create members-only content on subsites in the network. The membership levels of your main site are mirrored in each subsite.</p>\n<p>Read full documentation at <a href="https://www.paidmembershipspro.com/add-ons/pmpro-network-membership/">https://www.paidmembershipspro.com/add-ons/pmpro-network-membership/</a></p>";s:3:"FAQ";s:511:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-network-subsite/issues">https://github.com/strangerstudios/pmpro-network-subsite/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:167:"<h4>Changelog</h4><p>0.5.2 - 2024-03-05</p><ul>\n<li>BUG FIX: Fixed a minor typo regarding the PHP constant "PMPRO_MULTISITE_REWRITE_URLS" released in V0.5.1</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:78:"http://license.paidmembershipspro.com/downloads/plus/pmpro-network-subsite.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:20:"Multisite Membership";}i:69;a:16:{s:4:"Name";s:39:"Paid Memberships Pro - Nav Menus Add On";s:5:"Title";s:39:"Paid Memberships Pro - Nav Menus Add On";s:9:"PluginURI";s:59:"https://www.paidmembershipspro.com/add-ons/pmpro-nav-menus/";s:4:"Slug";s:15:"pmpro-nav-menus";s:6:"plugin";s:35:"pmpro-nav-menus/pmpro-nav-menus.php";s:7:"Version";s:3:"0.4";s:11:"Description";s:100:"Creates member navigation menus and swaps your theme\'s navigation based on a user\'s Membership Level";s:12:"Installation";s:422:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-nav-menus</code> folder to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Optionally create level-specific navigation menus on the <code>Edit Membership Level</code> admin.</li>\n<li>Create new navigation menu(s) for your members and assign them to the appropriate Theme Location.</li>\n</ol>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:76:"http://license.paidmembershipspro.com/downloads/standard/pmpro-nav-menus.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:9:"Nav Menus";}i:70;a:16:{s:4:"Name";s:42:"Paid Memberships Pro - Pay by Check Add On";s:5:"Title";s:42:"Paid Memberships Pro - Pay by Check Add On";s:9:"PluginURI";s:69:"https://www.paidmembershipspro.com/add-ons/pmpro-pay-by-check-add-on/";s:4:"Slug";s:18:"pmpro-pay-by-check";s:6:"plugin";s:41:"pmpro-pay-by-check/pmpro-pay-by-check.php";s:7:"Version";s:3:"1.1";s:11:"Description";s:106:"A collection of customizations useful when allowing users to pay by check for Paid Memberships Pro levels.";s:12:"Installation";s:843:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-pay-by-check</code> folder to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Change your Payment Settings to the "Pay by Check" gateway and make sure to set the "Instructions" with instructions for how to pay by check. Save.</li>\n<li>Change the Payment Settings back to use your gateway of choice. Behind the scenes the Pay by Check settings are still stored.</li>\n<li>Edit your membership levels and set the "Pay by Check Settings" for each level.</li>\n</ol>\n<p>If you would like to change the wording from "Pay by Check" to something else, you can use this custom code:\n<a href="https://gist.github.com/strangerstudios/68bb75bf3b83530390d4">https://gist.github.com/strangerstudios/68bb75bf3b83530390d4</a></p>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:376:"<h4>Changelog</h4><p>1.1 - 2024-07-17</p><ul>\n<li>ENHANCEMENT: Added support for v3.1+ Paid Memberships Pro frontend changes. #120 (@MaximilianoRicoTabo, @kimcoleman)</li>\n<li>BUG FIX: Now only sending the cancellation email if a level was removed. #118 (@dparker1005)</li>\n<li>BUG FIX: Fixed issue where crons were not being set up or disabled. #121 (@dparker1005)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:79:"http://license.paidmembershipspro.com/downloads/standard/pmpro-pay-by-check.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:12:"Pay by Check";}i:71;a:16:{s:4:"Name";s:38:"Paid Memberships Pro - PayFast Gateway";s:5:"Title";s:38:"Paid Memberships Pro - PayFast Gateway";s:9:"PluginURI";s:67:"https://www.paidmembershipspro.com/add-ons/payfast-payment-gateway/";s:4:"Slug";s:13:"pmpro-payfast";s:6:"plugin";s:31:"pmpro-payfast/pmpro-payfast.php";s:7:"Version";s:5:"1.5.1";s:11:"Description";s:58:"Adds PayFast as a gateway option for Paid Memberships Pro.";s:12:"Installation";s:1007:"<p>Installation</p><ol>\n<li>Make sure you have the Paid Memberships Pro plugin installed and activated.</li>\n<li>Upload the <code>pmpro-payfast</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Go to Memberships -&gt; Payment Settings in your WordPress dashboard to complete the Payfast settings.</li>\n</ol><p>Setup</p><ol>\n<li>Register and validate your account with Payfast: <a href="https://registration.payfast.io/">https://registration.payfast.io/</a>.</li>\n<li>Log in to your Payfast account and select \'Settings\' to retrieve your merchant details.</li>\n<li>Log in to your WordPress dashboard and navigate to Memberships &gt; Payment Settings.</li>\n<li>Set your "Payment Gateway" to "Payfast". Fill out your merchant details and Security Passphrase (required in order to accept recurring payments).</li>\n<li>Set your currency to "South African Rand".</li>\n<li>Save your settings.</li>\n</ol>";s:3:"FAQ";s:1038:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-payfast/issues">https://github.com/strangerstudios/pmpro-payfast/issues</a></p>\n<p>For immediate help, also post to our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p><p>I need to test Payfast in sandbox mode.</p><p>To test Payfast payments without being billed in sandbox mode requires a sandbox account from PayFast. For more information in creating a sandbox account - <a href="https://developers.payfast.co.za/documentation/#the-sandbox">https://developers.payfast.co.za/documentation/#the-sandbox</a></p>";s:9:"Changelog";s:151:"<h4>Changelog</h4><p>1.5.1 - 2024-05-24</p><ul>\n<li>BUG FIX: Fixed an issue where certain custom fields weren\'t saving correctly. (@ipokkel)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:56:"https://downloads.wordpress.org/plugin/pmpro-payfast.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:15:"PayFast Gateway";}i:72;a:16:{s:4:"Name";s:54:"Paid Memberships Pro - Payflow Recurring Orders Add On";s:5:"Title";s:54:"Paid Memberships Pro - Payflow Recurring Orders Add On";s:9:"PluginURI";s:74:"https://www.paidmembershipspro.com/add-ons/payflow-recurring-orders-addon/";s:4:"Slug";s:30:"pmpro-payflow-recurring-orders";s:6:"plugin";s:65:"pmpro-payflow-recurring-orders/pmpro-payflow-recurring-orders.php";s:7:"Version";s:5:"0.3.1";s:11:"Description";s:72:"Check daily for new recurring orders in Payflow and add as PMPro orders.";s:12:"Installation";s:703:"<p>Installation</p><p>Prerequisites</p><ol>\n<li>You must have Paid Memberships Pro installed and activated on your site.</li>\n</ol><p>Download, Install and Activate!</p><ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-payflow-recurring-orders/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>That’s it. No settings.</li>\n</ol>\n<p>View full documentation at: <a href="https://www.paidmembershipspro.com/add-ons/payflow-recurring-orders-addon/">https://www.paidmembershipspro.com/add-ons/payflow-recurring-orders-addon/</a></p>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:194:"<h4>Changelog</h4><p>0.3.1 - 2024-01-05</p><ul>\n<li>BUG FIX/ENHANCEMENT: Marking plugin as incompatible with Multiple Memberships Per User for the PMPro v3.0 update. #6 (@dparker1005)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:33:"htts://www.paidmembershipspro.com";s:8:"Download";s:87:"http://license.paidmembershipspro.com/downloads/free/pmpro-payflow-recurring-orders.zip";s:7:"License";s:4:"free";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:24:"Payflow Recurring Orders";}i:73;a:16:{s:4:"Name";s:43:"Paid Memberships Pro - Payment Plans Add On";s:5:"Title";s:43:"Paid Memberships Pro - Payment Plans Add On";s:9:"PluginURI";s:63:"https://www.paidmembershipspro.com/add-ons/pmpro-payment-plans/";s:4:"Slug";s:19:"pmpro-payment-plans";s:6:"plugin";s:43:"pmpro-payment-plans/pmpro-payment-plans.php";s:7:"Version";s:3:"0.3";s:11:"Description";s:84:"Integrates with Paid Memberships Pro to provide payment plans for membership levels.";s:12:"Installation";s:1381:"<p>Installation</p><p>Prerequisites</p><ol>\n<li>You must have Paid Memberships Pro installed and activated on your site.</li>\n</ol><p>Download, Install and Activate!</p><ol>\n<li>Download the latest version of the plugin.</li>\n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-approvals/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol><p>How to Use</p><ol>\n<li>Create a membership level and set the pricing on the level to the default or most popular payment you offer. For example, set the main level up as a fixed price per month.</li>\n<li>Then, locate the “Payment Plans” section and click the “Add Payment Plan” button.</li>\n<li>Expand the individual payment plan to adjust the name, pricing details, and any additional settings related to expiration or trials.</li>\n<li>Add additional payment plans if you’d like to offer more than one. The default level pricing will be shown first in the list with any additional active payment plans shown below.</li>\n<li>Save the membership level and browse to the checkout page for that level to see your plans in action.</li>\n</ol>\n<p>View full documentation at: <a href="https://www.paidmembershipspro.com/add-ons/pmpro-payment-plans/">https://www.paidmembershipspro.com/add-ons/pmpro-payment-plans/</a></p>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:730:"<h4>Changelog</h4><p>0.3 - 2023-08-24</p><ul>\n<li>ENHANCEMENT: General improvements to accessibility for screen readers. (@kimcoleman)</li>\n<li>ENHANCEMENT: Show the payment plan name on the account and billing page instead of just the level\'s name. (@JarrydLong)</li>\n<li>ENHANCEMENT: Added a filter to allow the payment plan name and cost text to be changed - <code>pmpropp_plan_cost_text_checkout</code>. (@andrewlimaza)</li>\n<li>REFACTOR: Refactored code to use default get_option instead of our own wrapper function. (@dwanjuki)</li>\n<li>BUG FIX: Fixed issues where offsite gateways such as PayPal Express, PayFast and other gateways wouldn\'t show the correct amount charged in the order information. (@JarrydLong)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:76:"http://license.paidmembershipspro.com/downloads/plus/pmpro-payment-plans.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:13:"Payment Plans";}i:74;a:16:{s:4:"Name";s:41:"Paystack Gateway for Paid Memberships Pro";s:5:"Title";s:41:"Paystack Gateway for Paid Memberships Pro";s:9:"PluginURI";s:60:"https://www.paidmembershipspro.com/add-ons/paystack-gateway/";s:4:"Slug";s:37:"paystack-gateway-paid-memberships-pro";s:6:"plugin";s:79:"paystack-gateway-paid-memberships-pro/paystack-gateway-paid-memberships-pro.php";s:7:"Version";s:5:"1.7.6";s:11:"Description";s:64:"Plugin to add Paystack payment gateway into Paid Memberships Pro";s:12:"Installation";s:774:"<p>Installation</p><p>Minimum Requirements</p><ul>\n<li>Confirm that your server can conclude a TLSv1.2 connection to Paystack\'s servers. More information about this requirement can be gleaned here: <a href="https://developers.paystack.co/blog/tls-v12-requirement">TLS v1.2 requirement</a>.</li>\n<li>Installed and activated [Paid Membership Pro Plugin] (<a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a>)</li>\n</ul><p>Manual installation</p><p>The manual installation method involves downloading our payment plugin and uploading it to your webserver via your favourite FTP application. The WordPress codex contains <a href="https://codex.wordpress.org/Managing_Plugins#Manual_Plugin_Installation">instructions on how to do this here</a>.</p>";s:3:"FAQ";s:678:"<p>Frequently Asked Questions</p><p>Where can I find help and documentation to understand Paystack?</p><p>You can find help and information on Paystack on our <a href="https://paystack.com/help">Help Desk</a></p><p>Where can I get support or talk to other users?</p><p>If you get stuck, you can ask for help in the <a href="https://wordpress.org/support/plugin/paystack-gateway-paid-memberships-pro">Paystack Gateway for Paid Membership Pro Plugin Forum</a>.</p><p>Paystack Gateway for Paid Membership Pro is awesome! Can I contribute?</p><p>Yes you can! Join in on our <a href="https://github.com/strangerstudios/paystack-gateway-paid-memberships-pro">GitHub repository</a></p>";s:9:"Changelog";s:543:"<h4>Changelog</h4><p>1.7.6 - 2024-07-03</p><ul>\n<li>ENHANCEMENT: Added webhook logging functionality to debug incoming webhook data. You may use the constant \'PMPRO_PAYSTACK_WEBHOOK_LOG\' to enable this feature. Please delete logs and disable this constant after completing debugging.</li>\n<li>BUG FIX: Fixed an issue where the webhook handler was not correctly storing the order amount if the subscription amount changed.</li>\n<li>BUG FIX: Fixed an issue when renewal payments were being processed and failing to complete the order.</li>\n</ul>";s:6:"Author";s:30:"Paid Memberships Pro, Paystack";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:80:"https://downloads.wordpress.org/plugin/paystack-gateway-paid-memberships-pro.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:41:"Paystack Gateway for Paid Memberships Pro";}i:75;a:16:{s:4:"Name";s:25:"PMPro Levels as UL Layout";s:5:"Title";s:25:"PMPro Levels as UL Layout";s:9:"PluginURI";s:53:"http://www.paidmembershipspro.com/wp/pmpro-ul-levels/";s:4:"Slug";s:15:"pmpro-ul-levels";s:6:"plugin";s:35:"pmpro-ul-levels/pmpro-ul-levels.php";s:7:"Version";s:2:".1";s:11:"Description";s:107:"Display your Membership Levels page in a UL Layout (includes classes for Foundation by ZURB Pricing table).";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:42:"Stranger Studios / Tweaked by Lasse Larsen";s:9:"AuthorURI";s:28:"http://www.seventysixnyc.com";s:8:"Download";s:73:"https://license.paidmembershipspro.com/downloads/plus/pmpro-ul-levels.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:25:"PMPro Levels as UL Layout";}i:76;a:16:{s:4:"Name";s:34:"Paid Memberships Pro - Pods Add On";s:5:"Title";s:34:"Paid Memberships Pro - Pods Add On";s:9:"PluginURI";s:60:"https://www.paidmembershipspro.com/add-ons/pods-integration/";s:4:"Slug";s:10:"pmpro-pods";s:6:"plugin";s:25:"pmpro-pods/pmpro-pods.php";s:7:"Version";s:5:"1.0.2";s:11:"Description";s:232:"Integrates Paid Memberships Pro with the Pods Framework to add groups of fields to many areas of your membership site including Member Profiles, the Membership Checkout page, and admin screens including Membership Levels and Orders.";s:12:"Installation";s:323:"<p>Installation</p><ol>\n<li>Make sure you have the Paid Memberships Pro and Pods Framework plugins installed and activated.</li>\n<li>Upload the <code>pmpro-pods</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:690:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-pods/issues">https://github.com/strangerstudios/pmpro-pods/issues</a></p>\n<p>For immediate help, also post to our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:631:"<h4>Changelog</h4><p>1.0.2 - January 4th, 2022</p><ul>\n<li>ENHANCEMENT: Added support for two new locations on the PMPro checkout page: After User Fields and Checkout Boxes. (@sc0ttkclark)</li>\n<li>BUG FIX: Improved appearance of Pods fields on the PMPro checkout page so they more closely match styles used by PMPro. (@sc0ttkclark)</li>\n<li>BUG FIX: Prevent PHP notices from usage of certain PMPro hooks when <code>$user</code> object is not passed in. (@sc0ttkclark)</li>\n<li>BUG FIX: Prevent PHP notices on the PMPro checkout page when the PMPro Member pod does not exist and has not yet been extended. (@sc0ttkclark)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:35:"https://www.paidmembershipspro.com/";s:8:"Download";s:53:"https://downloads.wordpress.org/plugin/pmpro-pods.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:4:"Pods";}i:77;a:16:{s:4:"Name";s:60:"Paid Memberships Pro - Post Affiliate Pro Integration Add On";s:5:"Title";s:60:"Paid Memberships Pro - Post Affiliate Pro Integration Add On";s:9:"PluginURI";s:62:"http://www.paidmembershipspro.com/wp/pmpro-post-affiliate-pro/";s:4:"Slug";s:24:"pmpro-post-affiliate-pro";s:6:"plugin";s:53:"pmpro-post-affiliate-pro/pmpro-post-affiliate-pro.php";s:7:"Version";s:6:".2.1.1";s:11:"Description";s:67:"Process an affiliate via Post Affiliate Pro after a PMPro checkout.";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:30:"http://www.strangerstudios.com";s:8:"Download";s:82:"https://license.paidmembershipspro.com/downloads/plus/pmpro-post-affiliate-pro.zip";s:7:"License";s:4:"free";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:30:"Post Affiliate Pro Integration";}i:78;a:16:{s:4:"Name";s:39:"Paid Memberships Pro - Proration Add On";s:5:"Title";s:39:"Paid Memberships Pro - Proration Add On";s:9:"PluginURI";s:53:"http://www.paidmembershipspro.com/wp/pmpro-proration/";s:4:"Slug";s:15:"pmpro-proration";s:6:"plugin";s:35:"pmpro-proration/pmpro-proration.php";s:7:"Version";s:3:"1.0";s:11:"Description";s:62:"Simple proration for membership level upgrades and downgrades.";s:12:"Installation";s:207:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-proration</code> folder to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:1762:"<h4>Changelog</h4><p>1.0 - 2024-03-21</p><ul>\n<li>FEATURE: Now fully supporting delayed downgrades for PMPro v3.0+. #24 (@dparker1005)</li>\n<li>ENHANCEMENT: Improved proration accurancy by using the subscriptions table in PMPro v3.0+ to calculate the prorated amount. #24 (@dparker1005)</li>\n<li>ENHANCEMENT: Added localization support. (@dparker1005)</li>\n<li>BUG FIX/ENHANCEMENT: Now showing prorated level cost after applying a discount code. #4 (@TravisHardman)</li>\n<li>BUG FIX/ENHANCEMENT: Improving the accuracy of the <code>pmprorate_isDowngrade()</code> and <code>pmprorate_have_same_payment_period()</code> functions. #21 (@dparker1005)</li>\n<li>BUG FIX/ENHANCEMENT: When using PMPro v3.0+, prorations now only happen between levels in the same "one level per user" level group. #24 (@dparker1005)</li>\n<li>BUG FIX: Fixed issue where users would not keep their old membership level when downgrading. #14 (@dparker1005)</li>\n<li>BUG FIX: Fixed issue where users could be charged more than the original level cost if checking out for a level with a different billing period and previous recurring orders are missing. #11 (@dparker1005)</li>\n<li>BUG FIX: Fixed issue where users could receive a free initial payment if upgrading to a level with the same billing period and previous recurring orders are missing. #11 (@dparker1005)</li>\n<li>BUG FIX: Fixed issue where subscriptions purchased during a downgrade would charge 1 payment period from the downgrade. Instead, the first recurring payment is now charged on the "next payment date" for the old subscription. (@ideadude)</li>\n<li>REFACTOR: Moved code into separate files for clarity. #23 (@dparker1005)</li>\n<li>DEPRECATED: Deprecated old functions that are not called. #22 (@dparker1005)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:72:"http://license.paidmembershipspro.com/downloads/plus/pmpro-proration.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:9:"Proration";}i:79;a:16:{s:4:"Name";s:51:"Paid Memberships Pro - Reason For Cancelling Add On";s:5:"Title";s:51:"Paid Memberships Pro - Reason For Cancelling Add On";s:9:"PluginURI";s:67:"https://www.paidmembershipspro.com/add-ons/pmpro-reason-cancelling/";s:4:"Slug";s:27:"pmpro-reason-for-cancelling";s:6:"plugin";s:59:"pmpro-reason-for-cancelling/pmpro-reason-for-cancelling.php";s:7:"Version";s:3:"1.1";s:11:"Description";s:67:"Adds a field to specify a reason for cancelling to the cancel page.";s:12:"Installation";s:235:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-reason-for-cancelling</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:331:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-reason-for-cancelling/issues">https://github.com/strangerstudios/pmpro-reason-for-cancelling/issues</a></p>";s:9:"Changelog";s:277:"<h4>Changelog</h4><p>1.1 - 2024-07-15</p><ul>\n<li>ENHANCEMENT: Added support for v3.1+ Paid Memberships Pro frontend changes.</li>\n<li>BUG FIX: Fixed conflict with the Unlock Protocol Add On where the Edit Member panel for this Add On may not show. #30 (dparker1005)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:84:"http://license.paidmembershipspro.com/downloads/plus/pmpro-reason-for-cancelling.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:21:"Reason For Cancelling";}i:80;a:16:{s:4:"Name";s:39:"Paid Memberships Pro - Recurring Emails";s:5:"Title";s:39:"Paid Memberships Pro - Recurring Emails";s:9:"PluginURI";s:77:"https://www.paidmembershipspro.com/add-ons/recurring-payment-email-reminders/";s:4:"Slug";s:22:"pmpro-recurring-emails";s:6:"plugin";s:49:"pmpro-recurring-emails/pmpro-recurring-emails.php";s:7:"Version";s:3:"1.0";s:11:"Description";s:138:"Send members a reminder email prior to when their next recurring subscription payment is made to let them know payment is processing soon.";s:12:"Installation";s:230:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-recurring-emails</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:567:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-recurring-emails/issues">https://github.com/strangerstudios/pmpro-recurring-emails/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:962:"<h4>Changelog</h4><p>1.0 - 2023-12-22</p><ul>\n<li>ENHANCEMENT: For sites running PMPro 3.0+, this plugin now uses the Subscriptions table to more accurately determine when to send emails and to add compatibility with Multiple Memberships Per User. #28 (@dparker1005)</li>\n<li>ENHANCEMENT: Added a new constant <code>PMPROR_DEBUG</code> to allow setting an email address to send log data to or to have the log data printed to a file. #34 (@dparker1005)</li>\n<li>ENHANCEMENT: Added localization support. #35 (@dparker1005)</li>\n<li>BUG FIX: Fixed issue where customized email template data may not be sent. #36 (@andrewlimaza, @dparker1005)</li>\n<li>BUG FIX: Fixed issue where the <code>!!billing_amount!!</code> email template variable would sometimes incorrectly return $0 instead of the actual billing amount. #29 (@MaximilianoRicoTabo)</li>\n<li>REFACTOR: Now using <code>get_option()</code> instead of <code>pmpro_getOption()</code>. #31 (@dwanjuki)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:83:"http://license.paidmembershipspro.com/downloads/standard/pmpro-recurring-emails.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:16:"Recurring Emails";}i:81;a:16:{s:4:"Name";s:45:"Paid Memberships Pro - Register Helper Add On";s:5:"Title";s:45:"Paid Memberships Pro - Register Helper Add On";s:9:"PluginURI";s:97:"https://www.paidmembershipspro.com/add-ons/pmpro-register-helper-add-checkout-and-profile-fields/";s:4:"Slug";s:21:"pmpro-register-helper";s:6:"plugin";s:47:"pmpro-register-helper/pmpro-register-helper.php";s:7:"Version";s:5:"1.8.3";s:11:"Description";s:90:"Add custom form fields to membership checkout and user profiles with Paid Memberships Pro.";s:12:"Installation";s:2976:"<p>Installation</p><p>Note: This plugin doesn\'t require <a href="https://wordpress.org/plugins/paid-memberships-pro/">Paid Memberships Pro</a>, but it is strongly recommended for sites that want to build a membership site and capture user profile information as part of free or paid member registration.</p>\n<h3>Install PMPro Register Helper from within WordPress</h3>\n<ol>\n<li>Visit the plugins page within your dashboard and select "Add New"</li>\n<li>Search for "PMPro Register Helper"</li>\n<li>Locate this plugin and click "Install"</li>\n<li>Activate "Paid Memberships Pro - Register Helper Add On" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>Install PMPro Register Helper Manually</h3>\n<ol>\n<li>Upload the <code>pmpro-register-helper</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate "Paid Memberships Pro - Register Helper" through the "Plugins" menu in WordPress</li>\n<li>Go to "after activation" below.</li>\n</ol>\n<h3>After Activation: Set Up Your Custom Fields</h3><p>Adding Fields to Membership Checkout</p><p>Register Helper allows you to add fields to a variety of places within the Membership Checkout page using Paid Memberships Pro. Fields can be added to existing locations including:</p>\n<ul>\n<li>after_username</li>\n<li>after_password</li>\n<li>after_email</li>\n<li>after_captcha</li>\n<li>after_billing_fields</li>\n<li>before_submit_button</li>\n</ul>\n<p>If you would like to add fields to the profile only, specify the \'just_profile\' location.</p>\n<p>Fields must be configured using custom code. We offer support for creating up to 5 fields as part of your <a href="https://www.paidmembershipspro.com/pricing/?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-register-helper">premium membership</a>.</p>\n<p><a href="https://www.paidmembershipspro.com/documentation/register-helper-documentation/adding-fields/?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-register-helper">View the full documentation on adding fields</a> and <a href="https://www.youtube.com/watch?v=VVTHYPQpfZ4">check out this video demo on Register Helper set up</a>.</p><p>Adding New Sections to Membership Checkout</p><p>You can add a new box or \'section\' to the Membership Checkout form using the \'checkout_boxes\' feature. Your newly created box includes a title, description, and loads in the specified location.</p>\n<p><a href="https://www.paidmembershipspro.com/documentation/register-helper-documentation/adding-fields/#checkout-boxes?utm_source=wordpress-org&amp;utm_medium=readme&amp;utm_campaign=pmpro-register-helper">Read the documentation on Custom Checkout Boxes</a></p><p>Restrict Membership Checkout by Email Address or Username</p><p>Add your list of custom "approved" email addresses or usernames to the "Restrict by Email" or "Restrict by Username" field on the Memberships &gt; Settings &gt; Membership Levels &gt; Edit Level admin page.</p>";s:3:"FAQ";s:319:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-register-helper/issues">https://github.com/strangerstudios/pmpro-register-helper/issues</a></p>";s:9:"Changelog";s:147:"<h4>Changelog</h4><p>1.8.3 - 2023-03-17</p><ul>\n<li>BUG FIX: Reverting v1.8.2 changes which were not needed and potentially problematic.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:64:"https://downloads.wordpress.org/plugin/pmpro-register-helper.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:15:"Register Helper";}i:82;a:16:{s:4:"Name";s:47:"Paid Memberships Pro - Require Strong Passwords";s:5:"Title";s:47:"Paid Memberships Pro - Require Strong Passwords";s:9:"PluginURI";s:68:"https://www.paidmembershipspro.com/add-ons/require-strong-passwords/";s:4:"Slug";s:22:"pmpro-strong-passwords";s:6:"plugin";s:49:"pmpro-strong-passwords/pmpro-strong-passwords.php";s:7:"Version";s:5:"0.5.0";s:11:"Description";s:51:"Force users to submit strong passwords on checkout.";s:12:"Installation";s:220:"<p>Installation</p><ol>\n<li>Upload the ‘pmpro-strong-passwords’ directory to the ‘/wp-content/plugins/’ directory of your site.</li>\n<li>Activate the plugin through the ‘Plugins’ menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:188:"<p>Frequently Asked Questions</p><p>I need help with this plugin</p><p>Please post support topics to <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a></p>";s:9:"Changelog";s:695:"<h4>Changelog</h4><p>0.5 - 2021-09-28</p><ul>\n<li>ENHANCEMENT: Added new filter to allow less required characters for site\'s using the custom password checker <code>pmprosp_minimum_password_length</code>. #41 (@mircobabini)</li>\n<li>ENHANCEMENT: Update the Zxcvbn library to support PHP 8.0. #43 (@mircobabini)</li>\n<li>BUG FIX/ENHANCEMENT: Fixed JavaScript warning for WordPress sites on 5.5.0+, support the newer method <code>userInputDisallowedList</code>. #37 (@andrewlimaza)</li>\n<li>BUG FIX/ENHANCEMENT: Fixed issue for sites running PHP 7.2 or lower. New requirements for the Zxcvbn library requires PHP 7.2+, older PHP versions will run our custom checker. #35 (@andrewlimaza)</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:79:"http://license.paidmembershipspro.com/downloads/free/pmpro-strong-passwords.zip";s:7:"License";s:4:"free";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:24:"Require Strong Passwords";}i:83;a:16:{s:4:"Name";s:35:"Paid Memberships Pro - Roles Add On";s:5:"Title";s:35:"Paid Memberships Pro - Roles Add On";s:9:"PluginURI";s:55:"https://www.paidmembershipspro.com/add-ons/pmpro-roles/";s:4:"Slug";s:11:"pmpro-roles";s:6:"plugin";s:27:"pmpro-roles/pmpro-roles.php";s:7:"Version";s:5:"1.4.2";s:11:"Description";s:48:"Adds a WordPress Role for each Membership Level.";s:12:"Installation";s:252:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-roles</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>That\'s it. No settings.</li>\n</ol>";s:3:"FAQ";s:547:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-roles/issues">https://github.com/strangerstudios/pmpro-roles/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:242:"<h4>Changelog</h4><p>1.4.2 - 2022-12-12</p><ul>\n<li>ENHANCEMENT: Improved UI for role selection in the edit level settings.</li>\n<li>BUG FIX: Fixed issue where fatal error was being caused when Paid Memberships Pro was deactivated.</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:68:"http://license.paidmembershipspro.com/downloads/free/pmpro-roles.zip";s:7:"License";s:4:"free";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:5:"Roles";}i:84;a:16:{s:4:"Name";s:29:"Paid Memberships Pro - Series";s:5:"Title";s:29:"Paid Memberships Pro - Series";s:9:"PluginURI";s:78:"https://www.paidmembershipspro.com/add-ons/pmpro-series-for-drip-feed-content/";s:4:"Slug";s:12:"pmpro-series";s:6:"plugin";s:29:"pmpro-series/pmpro-series.php";s:7:"Version";s:3:"0.7";s:11:"Description";s:121:"Drip feed content to your members over the course of their membership. Serializes content by # of days post-registration.";s:12:"Installation";s:403:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-series</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Navigate to the Series menu in the WordPress dashboard to create a new series.</li>\n<li>Add posts to series using the "Posts in this Series" meta box under the post content.</li>\n</ol>";s:3:"FAQ";s:301:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-series/issues">https://github.com/strangerstudios/pmpro-series/issues</a></p>";s:9:"Changelog";s:238:"<h4>Changelog</h4><p>0.7 - 2024-07-19</p><ul>\n<li>ENHANCEMENT: Updated the frontend UI for compatibility with PMPro v3.1. #108, #109 (@dparker1005, @kimcoleman)</li>\n<li>BUG FIX: Fixed some PHP 8.2+ warnings. #109 (@kimcoleman)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:69:"http://license.paidmembershipspro.com/downloads/plus/pmpro-series.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:6:"Series";}i:85;a:16:{s:4:"Name";s:27:"Seriously Simple Podcasting";s:5:"Title";s:27:"Seriously Simple Podcasting";s:9:"PluginURI";s:122:"https://castos.com/seriously-simple-podcasting/?utm_medium=sspodcasting&utm_source=wordpress&utm_campaign=wpplugin_08_2019";s:4:"Slug";s:27:"seriously-simple-podcasting";s:6:"plugin";s:59:"seriously-simple-podcasting/seriously-simple-podcasting.php";s:7:"Version";s:6:"2.13.0";s:11:"Description";s:104:"Podcasting the way it\'s meant to be. No mess, no fuss - just you and your content taking over the world.";s:12:"Installation";s:845:"<p>Installation</p><p>Installing "Seriously Simple Podcasting" can be done either by searching for "Seriously Simple Podcasting" via the "Plugins &gt; Add New" screen in your WordPress dashboard, or by using the following steps:</p>\n<ol>\n<li>Download the plugin via WordPress.org</li>\n<li>Upload the ZIP file through the \'Plugins &gt; Add New &gt; Upload\' screen in your WordPress dashboard</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress</li>\n<li>Customise the plugin from the \'Podcast &gt; Settings\' page</li>\n</ol><p>Where are the FAQs?</p><p>You can find complete user and developer documentation (along with the FAQs) on <a href="https://castos.com/podcast-hosting-wordpress/?utm_medium=sspodcasting&amp;utm_source=wordpress&amp;utm_campaign=wpplugin_08_2019">the Seriously Simple Podcasting documentation site</a>.</p>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:703:"<h4>Changelog</h4><p>2.13.0</p><ul>\n<li>2022-04-18</li>\n<li>UPDATE SUMMARY: Podping notification when feed is updated, code refactoring, minor improvements</li>\n<li>[UPDATE] Podping notification when feed is updated</li>\n<li>[UPDATE] Code refactoring: moved podcast CPT functions to a separate controller</li>\n<li>[UPDATE] PMPro integration: possibility to enable/disable integration with settings</li>\n<li>[UPDATE] Changed the contributing guide from GitHub to GitLab</li>\n<li>[FIX] Fixed Elementor episode list widget in compact mode</li>\n<li>[FIX] Bug fixed: Yoast integration critical error</li>\n<li>[FIX] Fixed the Twitter share URL</li>\n<li>[FIX] Fixed intermittent update episode error</li>\n</ul>";s:6:"Author";s:6:"Castos";s:9:"AuthorURI";s:94:"https://castos.com/?utm_medium=sspodcasting&utm_source=wordpress&utm_campaign=wpplugin_08_2019";s:8:"Download";s:70:"https://downloads.wordpress.org/plugin/seriously-simple-podcasting.zip";s:7:"License";s:13:"wordpress.org";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:27:"Seriously Simple Podcasting";}i:86;a:16:{s:4:"Name";s:50:"Paid Memberships Pro - Set Expiration Dates Add On";s:5:"Title";s:50:"Paid Memberships Pro - Set Expiration Dates Add On";s:9:"PluginURI";s:64:"http://www.paidmembershipspro.com/wp/pmpro-set-expiration-dates/";s:4:"Slug";s:26:"pmpro-set-expiration-dates";s:6:"plugin";s:57:"pmpro-set-expiration-dates/pmpro-set-expiration-dates.php";s:7:"Version";s:3:"0.7";s:11:"Description";s:95:"Set a specific expiration date (e.g. 2013-12-31) for a PMPro membership level or discount code.";s:12:"Installation";s:318:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-set-expiration-date</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Change the expiration date on the edit levels and edit discount code pages.</li>\n</ol>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:513:"<h4>Changelog</h4><p>0.7 - 2024-04-24</p><ul>\n<li>ENHANCEMENT: Support Paystack and PayFast payment gateway.</li>\n<li>ENHANCEMENT: Applied WordPress Coding Standards to code (improves readability).</li>\n<li>ENHANCEMENT: Improved support to show the expiration date when a discount code is applied.</li>\n<li>ENHANCEMENT: Moved Set Expiration Date settings to Expiration Date tab in the Membership Level settings.</li>\n<li>BUG FIX: Fixed an issue in some cases where the expiration date was losing a day.</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:30:"http://www.strangerstudios.com";s:8:"Download";s:83:"http://license.paidmembershipspro.com/downloads/free/pmpro-set-expiration-dates.zip";s:7:"License";s:4:"free";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:20:"Set Expiration Dates";}i:87;a:16:{s:4:"Name";s:38:"Paid Memberships Pro - Shipping Add On";s:5:"Title";s:38:"Paid Memberships Pro - Shipping Add On";s:9:"PluginURI";s:80:"https://www.paidmembershipspro.com/add-ons/shipping-address-membership-checkout/";s:4:"Slug";s:14:"pmpro-shipping";s:6:"plugin";s:33:"pmpro-shipping/pmpro-shipping.php";s:7:"Version";s:3:"1.3";s:11:"Description";s:62:"Add shipping address to the checkout page and other locations.";s:12:"Installation";s:516:"<p>Installation</p><ol>\n<li>Make sure you have the Paid Memberships Pro plugin installed and activated.</li>\n<li>Upload the <code>pmpro-shipping</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\n<p>Fields will automatically be captured for all membership levels. You can remove the fields for a level on the Memberships &gt; Settings &gt; Edit Membership Level &gt; "Hide Shipping Address" ssetting.</p>";s:3:"FAQ";s:497:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-shipping/issues">https://github.com/strangerstudios/pmpro-shipping/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="http://www.paidmembershipspro.com">http://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:226:"<h4>Changelog</h4><p>1.3 - 2024-07-10</p><ul>\n<li>ENHANCEMENT: Added support for V3.1+ Paid Memberships Pro frontend changes and kept backwards compatibility for older versions. (@MaximilianoRicoTabo, @andrewlimaza)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:75:"http://license.paidmembershipspro.com/downloads/standard/pmpro-shipping.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:8:"Shipping";}i:88;a:16:{s:4:"Name";s:46:"Paid Memberships Pro - Signup Shortcode Add On";s:5:"Title";s:46:"Paid Memberships Pro - Signup Shortcode Add On";s:9:"PluginURI";s:66:"https://www.paidmembershipspro.com/add-ons/pmpro-signup-shortcode/";s:4:"Slug";s:22:"pmpro-signup-shortcode";s:6:"plugin";s:49:"pmpro-signup-shortcode/pmpro-signup-shortcode.php";s:7:"Version";s:5:"0.3.3";s:11:"Description";s:94:"Shortcode for a simplified Membership Signup Form with options for email only signup and more.";s:12:"Installation";s:438:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-signup-shortcode</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>\n<p>Add a sign up form to a post/widget/page using a shortcode:</p>\n<p>[pmpro_signup level="3" intro="0" redirect="referrer" short="emailonly" submit_button="Join Now" title="Sign Up for Gold Membership"]</p>";s:3:"FAQ";s:321:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-signup-shortcode/issues">https://github.com/strangerstudios/pmpro-signup-shortcode/issues</a></p>";s:9:"Changelog";s:149:"<h4>Changelog</h4><p>0.3.3 - 2024-03-21</p><ul>\n<li>BUG FIX/ENHANCEMENT: Added a checkout nonce needed for PMPro v3.0+. #56 (@dparker1005)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:35:"https://www.paidmembershipspro.com/";s:8:"Download";s:83:"http://license.paidmembershipspro.com/downloads/standard/pmpro-signup-shortcode.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:16:"Signup Shortcode";}i:89;a:16:{s:4:"Name";s:44:"Paid Memberships Pro - Sitewide Sales Add On";s:5:"Title";s:44:"Paid Memberships Pro - Sitewide Sales Add On";s:9:"PluginURI";s:58:"https://www.paidmembershipspro.com/add-ons/sitewide-sales/";s:4:"Slug";s:20:"pmpro-sitewide-sales";s:6:"plugin";s:45:"pmpro-sitewide-sales/pmpro-sitewide-sales.php";s:7:"Version";s:5:"1.2.5";s:11:"Description";s:143:"Create, manage, and view advanced reports for a sitewide or flash sale on membership (Black Friday or Cyber Monday) using Paid Memberships Pro.";s:12:"Installation";s:0:"";s:3:"FAQ";s:0:"";s:9:"Changelog";s:0:"";s:6:"Author";