n<li>Unzip the downloaded file to your computer.</li>\n<li>Upload the /pmpro-social-login/ directory to the /wp-content/plugins/ directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:0:"";s:9:"Changelog";s:531:"<h4>Changelog</h4><p>1.0 - 2023-08-11</p><ul>\n<li>BUG FIX/ENHANCEMENT: Updated localization and escaping of strings. #14 (@JarrydLong)</li>\n<li>BUG FIX/ENHANCEMENT: Updated some <code>&lt;h3&gt;</code> tags to <code>&lt;h2&gt;</code> tags for better accessibility. #17 (@ipokkel)</li>\n<li>BUG FIX: Fixed PHP errors when the core Paid Memberships Pro plugin is not active. #13 (@JarrydLong)</li>\n<li>REFACTOR: Now using <code>get_option()</code> instead of <code>pmpro_getOption()</code> to get options. #16 (@JarrydLong)</li>\n</ul>";s:6:"Author";s:16:"Stranger Studios";s:9:"AuthorURI";s:30:"http://www.strangerstudios.com";s:8:"Download";s:75:"http://license.paidmembershipspro.com/downloads/plus/pmpro-social-login.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:12:"Social Login";}i:93;a:16:{s:4:"Name";s:47:"Paid Memberships Pro - Sponsored Members Add On";s:5:"Title";s:47:"Paid Memberships Pro - Sponsored Members Add On";s:9:"PluginURI";s:67:"https://www.paidmembershipspro.com/add-ons/pmpro-sponsored-members/";s:4:"Slug";s:23:"pmpro-sponsored-members";s:6:"plugin";s:51:"pmpro-sponsored-members/pmpro-sponsored-members.php";s:7:"Version";s:6:"0.10.2";s:11:"Description";s:84:"Generate discount code for a main account holder to distribute to sponsored members.";s:12:"Installation";s:702:"<p>Installation</p><ol>\n<li>Upload the <code>pmpro-sponsored-members</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Create one level for paying account holders and one level for sponsored members.</li>\n<li>Edit the PMPROSM_MAIN_ACCOUNT_LEVEL constant in the plugin file to match your main account level id.</li>\n<li>Edit the PMPROSM_SPONSORED_ACCOUNT_LEVEL constant in the plugin file to match your sponsored level id.</li>\n<li>Edit the second half of the pmprosm_pmpro_after_change_membership_level() function to change the values of the discount code given to paying members.</li>\n</ol>";s:3:"FAQ";s:323:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the issues section of GitHub and we\'ll fix it as soon as we can. Thanks for helping. <a href="https://github.com/strangerstudios/pmpro-sponsored-members/issues">https://github.com/strangerstudios/pmpro-sponsored-members/issues</a></p>";s:9:"Changelog";s:408:"<h4>Changelog</h4><p>0.10.2 - 2023-07-25</p><ul>\n<li>BUG FIX: Fixed issue where the seat cost would always show $0 at checkout.</li>\n<li>ENHANCEMENT: Updated <code>&lt;h3&gt;</code> tags to <code>&lt;h2&gt;</code> tags for better accessibility.</li>\n<li>REFACTOR: Now getting level information at checkout from <code>pmpro_getLevelAtCheckout()</code> instead of pulling from <code>$_REQUEST</code></li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:80:"http://license.paidmembershipspro.com/downloads/plus/pmpro-sponsored-members.zip";s:7:"License";s:4:"plus";s:18:"HideFromAddOnsList";s:1:"1";s:9:"ShortName";s:17:"Sponsored Members";}i:94;a:16:{s:4:"Name";s:38:"Paid Memberships Pro - State Dropdowns";s:5:"Title";s:38:"Paid Memberships Pro - State Dropdowns";s:9:"PluginURI";s:58:"https://www.paidmembershipspro.com/add-ons/state-dropdown/";s:4:"Slug";s:21:"pmpro-state-dropdowns";s:6:"plugin";s:47:"pmpro-state-dropdowns/pmpro-state-dropdowns.php";s:7:"Version";s:3:"0.5";s:11:"Description";s:85:"Creates an autopopulated field for countries and states/provinces for billing fields.";s:12:"Installation";s:314:"<p>Installation</p><ol>\n<li>Make sure you have the Paid Memberships Pro plugin installed and activated.</li>\n<li>Upload the <code>pmpro-state-dropdowns</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:1335:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-state-dropdowns/issues">https://github.com/strangerstudios/pmpro-state-dropdowns/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p><p>The state fields are not showing correctly for pre-existing users</p><p>Existing users that have entered their State/Province before using this add-on may be required to update their profile while PMPro State Dropdowns is activated. This is usually caused by incorrect spelling of the State/Province. (This only affects the front-end of your site and won\'t affect the previously saved user meta)</p><p>Some States/Provinces are missing or incorrect from the State/Province dropdown</p><p>Not all countries may be fully supported regarding the State/Province list. If you find a fault with your country\'s State/Province list, please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-state-dropdowns/issues">https://github.com/strangerstudios/pmpro-state-dropdowns/issues</a></p>";s:9:"Changelog";s:505:"<h4>Changelog</h4><p>0.5 - 2024-07-18</p><ul>\n<li>ENHANCEMENT: Updated the frontend UI for compatibility with PMPro v3.1. #64 (@andrewlimaza)</li>\n<li>ENHANCEMENT: Now moving the Country field before the City field for better UX. #64 (@andrewlimaza)</li>\n<li>BUG FIX: Only using the <code>pmpro_longform_address</code> filter on pre-v3.1+ versions of PMPro (now the default behavior). #64 (@andrewlimaza)</li>\n<li>BUG FIX: Fixed error when the core PMPro plugin is not active. #61 (@JarrydLong)</li>\n</ul>";s:6:"Author";s:20:"Paid Memberships Pro";s:9:"AuthorURI";s:34:"https://www.paidmembershipspro.com";s:8:"Download";s:82:"http://license.paidmembershipspro.com/downloads/standard/pmpro-state-dropdowns.zip";s:7:"License";s:8:"standard";s:18:"HideFromAddOnsList";s:1:"0";s:9:"ShortName";s:15:"State Dropdowns";}i:95;a:16:{s:4:"Name";s:44:"Paid Memberships Pro - Stripe Billing Limits";s:5:"Title";s:44:"Paid Memberships Pro - Stripe Billing Limits";s:9:"PluginURI";s:71:"https://www.paidmembershipspro.com/add-ons/pmpro-stripe-billing-limits/";s:4:"Slug";s:27:"pmpro-stripe-billing-limits";s:6:"plugin";s:59:"pmpro-stripe-billing-limits/pmpro-stripe-billing-limits.php";s:7:"Version";s:3:"1.0";s:11:"Description";s:57:"Allow Billing Limits with Stripe as your primary gateway.";s:12:"Installation";s:360:"<p>Installation</p><ol>\n<li>Make sure you have the Paid Memberships Pro plugin installed and activated and that Stripe is your primary gateway.</li>\n<li>Upload the <code>pmpro-stripe-billing-limits</code> directory to the <code>/wp-content/plugins/</code> directory of your site.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n</ol>";s:3:"FAQ";s:525:"<p>Frequently Asked Questions</p><p>I found a bug in the plugin.</p><p>Please post it in the GitHub issue tracker here: <a href="https://github.com/strangerstudios/pmpro-stripe-billing-limits/issues">https://github.com/strangerstudios/pmpro-stripe-billing-limits/issues</a></p><p>I need help installing, configuring, or customizing the plugin.</p><p>Please visit our premium support site at <a href="https://www.paidmembershipspro.com">https://www.paidmembershipspro.com</a> for more documentation and our support forums.</p>";s:9:"Changelog";s:349:"<h4>Changelog</h4><p>1.0 - 2023-01-09</p><ul>\n<li>BUG FIX/ENHANCEMENT: No longer relying on usermeta to track billing limit data.</li>\n<li>BUG FIX/ENHANCEMEN